INSERT INTO `chunks` (`adminid`, `chunkid`, `chunk`) VALUES
('pranjal', 0, '\n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n1 \n  \nGOVERNMENT OF INDIA \n	\nINSERT INTO `chunks` (`adminid`, `chunkid`, `chunk`) VALUES
('pranjal', 47, 'necessary. \n Earth \nresistance \nCheck values of earth \nresistance   \nIf high, investigate and take \ncorrective action  \n \nBody \nCheck for peelings/ rusting/ \ndamage \n Repaint, as required \n \nCable box \nCheck the sealing \narrangement for filling holes\n \nEnsure sealing arrangement for \nfilling holes \n \n2.6 5 YEARLY SCHEDULE \nNote: In addition to yearly maintenance, carry out following works:  \n \nItems  Schedule Inspection Action required  \nSwitch yard \n \nGravel/crushed \nrock \n \nCheck condition, up layer and \nsize  \nRemove rounded pieces and \nmuck by screening. Maintain   \nup layer of 100 mm by \nadditional quantity of size 40mm\n \nTransformer \n Conservator \nInspect inside for sludge etc. \nClean or flush inside with oil \n Core and \nwindings \nOverall inspection including \nlifting of core and coils \nWash with clean dry oil. \n \nRollers \nExamine carefully during \noverhauling  \nGrease them properly \n Circuit breaker \nExamine carefully during \noverhauling \nOverhaul every circuit breaker  \ncomplet'),
('pranjal', 48, 'ls \nWash with clean dry oil. \n \nRollers \nExamine carefully during \noverhauling  \nGrease them properly \n Circuit breaker \nExamine carefully during \noverhauling \nOverhaul every circuit breaker  \ncompletely \n  \n2.7 TIPS FOR IMPROVING MAINTENANCE  \n \n2.7.1    Transformer \n \nThe principal object of transformer maintenance is to maintain the insulation in good \ncondition. Moisture, dust and excessive heat are the main reasons of insulation deterioration \nand avoidance of these will keep insulation in good condition. \n \n‚Ä¢ Oil \no Leakage of excessive oil to be investigated and repaired as early as possible. \no Maintain the record of oil used and always prefer the same make of oil for topping \nup  or  replacement.  The  oil  of  different  makes  may  be  separated  into  layers.  The \nmixture of oil have greater tendency to form acidity or sludge. \no Never use the released oil even if the same make. \no Never mix the transformer oil to the oil of switchgear equipment. \n\nCAMTECH/ E/11-12/Sub-sta'),
('pranjal', 49, 'il have greater tendency to form acidity or sludge. \no Never use the released oil even if the same make. \no Never mix the transformer oil to the oil of switchgear equipment. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n13 \no Only the dielectric strength does not indicate the healthy condition of oil. Therefore \nin  addition  to  chemical  tests  other  tests  such  as  acidity  test,  test  for  polar \ncontaminants, sludge also to be carried out. \no If the acidity exceeds limits, open the cover to ascertain the condition of interior of \ntank, core and windings. Take suitable action if sludge or corrosion is evident. \no DGA : Dissolve Gas Analysis to assess the internal condition of the transformer.   \n \n‚Ä¢ Transformer Body \no   Ensure correct pressure for'),
('pranjal', 50, 'gs. Take suitable action if sludge or corrosion is evident. \no DGA : Dissolve Gas Analysis to assess the internal condition of the transformer.   \n \n‚Ä¢ Transformer Body \no   Ensure correct pressure for tightening the nut and bolt at joints. Replace the gaskets \nas and when opened the gasketed joints. \no   Measure the insulation resistance without disturbing thing. \no   Properly clean the tank cover before opening it.  \no   Remove all nuts and bolts etc. and keep them properly, before removing the cover. \no   Dismount  bushings,  if  mounted  on  top.  Remove  the cover  carefully  if  core  and \nwindings are separate. If core and windings are suspended from tank cover, provide \neye bolts on the cover for lifting along with core and winding. Care should be taken \nto  ensure  vertical  removal  of  the  core.  After  lifting  the  core,  recount  and  tally  the \nspanners and tools used.  \no   The  spanner  should  be  cleaned  and  to  be  held  by  cotton  strap  or  string  tied  round'),
('pranjal', 51, 'l  of  the  core.  After  lifting  the  core,  recount  and  tally  the \nspanners and tools used.  \no   The  spanner  should  be  cleaned  and  to  be  held  by  cotton  strap  or  string  tied  round \nthe waist or wrist of the staff opening tank cover. \n‚Ä¢ Core and Windings \no   Lifting the core and coils \n Remove the fixing devices if core and coils are suspended, from each end near \nthe top. \n Unload the connections of bushings and remove the bushings from tank walls. \n Remove mechanical connection to the tap changing switch handle, if any. \n Remove any earthing strips between the core clamps and tank. \n Lift  the  core  and  coils  vertically  by  slinging  it  from  lifting  lugs  provided  on \ncore. Make sure that the sling does not foul against connections, tapping switch \netc. \n Allow the core and coils to drain oil into tank for some time. \n Now lower them on beams placed in a metal tray filled with saw dust or sand. \no   Inspection \n Ensure that everything is intact co'),
('pranjal', 52, '\n Allow the core and coils to drain oil into tank for some time. \n Now lower them on beams placed in a metal tray filled with saw dust or sand. \no   Inspection \n Ensure that everything is intact correctly. \n Leads are not pulled out off their places. \n Ensure tightness of nuts and bolts. \n Clean the sludge by transformer oil and ensure that ducts are not blocked. \n Clamp the windings firmly without any movement. Adjust the vertical tie bars \nto tighten loose windings or spacers. Properly tight the special coil adjustment \nbolt, if provided. \n Check the proper operation of tap changing switch. \n Tight all connections. \n Conduct insulation resistance test and take the corrective action. \n Remove sludge deposition at the bottom of tank. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maint'),
('pranjal', 53, '                                                                                 CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n14\n‚Ä¢ Bushing \no    Clean the bushing porcelain and examine for cracks and chips. Replace if required. \no     If the bushing is below oil level, lower the oil until it is below the bushing hole. \no     If only the porcelain is to be changed it may not be necessary to undo the internal \nbushing  connection,  for,  in  some  cases  the  bushing stems  are  joined  by  an \ninsulated bar to prevent them from turning when the nuts are undone. All the nuts \nat  the  top  of  the  bushing  should  be  removed  and  the  old  porcelain  lifted  straight \nup  over  the  central  stem,  which  remain  in  place.  Slide  the  new  porcelain  down \nover the stem and tighten the nuts. Too much strain on the porcelain should'),
('pranjal', 54, 'ld  porcelain  lifted  straight \nup  over  the  central  stem,  which  remain  in  place.  Slide  the  new  porcelain  down \nover the stem and tighten the nuts. Too much strain on the porcelain should not be \napplied when tightening  the connections. Change only one porcelain at a time.  If \nthe   insulated   bar   between   the   bushing   stems   is   not provided,   the   internal \nconnections  should  be  undone  and  the  whole  bushing removed  before  the \nporcelain is changed and then replace the porcelain. \no     When a complete bushing is to be changed the internal connection to the bushing \nshould be undone. If the replacement bushing has a socket at the bottom end, the \nold bushing should be unclamped and withdrawn from the tank. Now unplug the \nflexible  lead  from  the  old  bushing  and  plugged  into  the  new  one,  which  is  then \nlowered into the hole in the tank and re-clamped firmly but not too tightly. \n‚Ä¢ External Connection \no  The  bluish  tinge  characteristic'),
('pranjal', 55, 'bushing  and  plugged  into  the  new  one,  which  is  then \nlowered into the hole in the tank and re-clamped firmly but not too tightly. \n‚Ä¢ External Connection \no  The  bluish  tinge  characteristic  of  metal  indicates  overheating.  Either  it  become \nloose or dirty or the size of conductor is not suitable for carrying current. \no  A  small  copper  loop  to  bridge  the  top  cover  of  the  transformer  and  the  tank  may \nalso  be  provided  to  avoid  earth  fault  current  passing  through  the  fastening  bolts \nwhen there is a lighting surge, high voltage surge or failure of bushings. \n‚Ä¢ Conservator and Magnetic Oil Gauge \no    The oil level indicator should always be kept clean. \no    Replace the broken transparent material of level indicator immediately. \no     Examine  the  mechanism  of  oil  gauge  functioning properly  during  cleaning  of \nconservator. \n‚Ä¢ Breather \nThere are generally two types of breathers used on a transformer: \na. Plain breather \nb. Silica gel b'),
('pranjal', 56, '  mechanism  of  oil  gauge  functioning properly  during  cleaning  of \nconservator. \n‚Ä¢ Breather \nThere are generally two types of breathers used on a transformer: \na. Plain breather \nb. Silica gel breather \n The end of the plain breather should be kept clean and the ventilation holes \nfree of dust. If an oil seal has been provided, the oil should be wiped out. \n Silica  gel  dehydrating  breathers  are  fitted  with  a sight  glass  so  that  the \ncolour of the crystals may be seen. The colour changes from blue to pink as \nthe crystals absorb moisture. When the crystals  get saturated with moisture \nthey  become  predominantly  pink  and  should  therefore  be  reactivated.  The \nbody of the breather should be removed by undoing the nuts. If the crystals \nhave been kept in an inner container, the container should be removed, but if \nthey are not, the crystals should be removed into a shallow tray. The crystals \nshould  be  backed  at  a  temperature  of  about  200¬∞C  until  the  w'),
('pranjal', 57, 'tainer, the container should be removed, but if \nthey are not, the crystals should be removed into a shallow tray. The crystals \nshould  be  backed  at  a  temperature  of  about  200¬∞C  until  the  whole  mass  is \nrestored blue colour. Clean the breather and place the dry and blue crystals. \nRenew the oil in the sealing cup at the bottom. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n15 \n‚Ä¢ Buchholtz Relay \no  During operation if gas is found to be collecting and giving alarm, the gas should \nbe tested and analyzed to find out the nature of fault. Sometimes, it is noticed that \nthe gas collecting is only air. The reasons for this may be that the oil is releasing \nany  absorbed  air  due  to  change  in  temperature  or  due  to  leakage  on  the  suction'),
('pranjal', 58, ' it is noticed that \nthe gas collecting is only air. The reasons for this may be that the oil is releasing \nany  absorbed  air  due  to  change  in  temperature  or  due  to  leakage  on  the  suction \nside of pump. The absorbed air is released in initial stages only when no vacuum \nis  applied  during  filling  of  oil.  The  internal  faults  can  be  identified  to  a  great \nextent by a chemical analysis of gas. \no  Routine operation and mechanical inspection/tests should be carried out at one and \ntwo yearly intervals respectively. \no  The operation is tested by injecting air into the relay through the lower petcock of \na  double  float  relay  for  the  45¬∞  petcock  of  a  single  float  relay.  After  inspection, \nany air which has accumulated in the upper gas chamber must be released by the \nupper petcock, by filling the chamber with oil. \no  To carry out mechanical inspection, the oil level must be brought below the level \nof  relay.  Both  floats  should  be  able  to  rise '),
('pranjal', 59, 'sed by the \nupper petcock, by filling the chamber with oil. \no  To carry out mechanical inspection, the oil level must be brought below the level \nof  relay.  Both  floats  should  be  able  to  rise  and  fall  freely.  Relay  should  give \nalarm/trip  due  to  the  oil  level  falling  below  the  Buchholtz  level.  The  mercury \nswitches should be tightly clamped. If the glass of a mercury switch is cracked, it \nmust be replaced. \n‚Ä¢ Explosion Vent \no     Frequently inspect diaphragm of the vent and replace if required. \no     An  investigation  should  be  carried  out  to  determine  the  nature  and  cause  of  the \nfault before replacing the broken diaphragm. \n‚Ä¢ Gaskets \no     Check  the  tightness  of  all  bolts  fastening  gasketed  joints.  To  avoid  uneven \npressure,  the  bolts  should  be  tightened  evenly  round  the  joints.  Leaking  gaskets \nshould be replaced as soon as the circumstances permit. \n‚Ä¢ Pipe Work \no     Inspect the pipe work for leakage due to slack unio'),
('pranjal', 60, 's  should  be  tightened  evenly  round  the  joints.  Leaking  gaskets \nshould be replaced as soon as the circumstances permit. \n‚Ä¢ Pipe Work \no     Inspect the pipe work for leakage due to slack unions, mis-alignment. \no     Align the pipe and remade the joint. \n‚Ä¢ Temperature Indicators \no     At  each  yearly  maintenance  inspection,  the  level  of  oil  in  the  pockets  holding \nthermometer  bulbs  should  be  checked  and  the  oil  replenished,  if  required.  The \ncapillary  tubing  should  be  fastened  down  again  if  it  has  become  loose.  Dial \nglasses should be kept clear and if broken, replaced as soon as possible to prevent \ndamage  to  the  instrument.  Temperature  indicators  should  be  calibrated  with \nstandard thermometer immersed in hot oil bath if found to be reading incorrectly. \n‚Ä¢ Spares \no     It  is  a  healthy  practice  to  have  essential  spares  like  one  member  of  each  type  of \nbushings, one spare limb winding, one thermometer, one cooling fan'),
('pranjal', 61, 'ading incorrectly. \n‚Ä¢ Spares \no     It  is  a  healthy  practice  to  have  essential  spares  like  one  member  of  each  type  of \nbushings, one spare limb winding, one thermometer, one cooling fan, etc, for each \ngroup of similar transformer. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n16\n2.7.2    Circuit Breakers   \n \nCircuit  breakers  usually  need  more  frequent  and  more  prolonged  maintenance.  In \ngeneral, for maintenance of CB the instructions of manufacturer should be followed. A few \nsalient points on maintenance of CB are given below: \n \nUnder  normal  operating  conditions  during  regular  inspections  following  checks \nshould be done: \n‚Ä¢ The contacts should be checked for proper alignmen'),
('pranjal', 62, 'ts on maintenance of CB are given below: \n \nUnder  normal  operating  conditions  during  regular  inspections  following  checks \nshould be done: \n‚Ä¢ The contacts should be checked for proper alignment. \n‚Ä¢ The oil level should be checked and maintained. \n‚Ä¢ The  oil  condition  should  be  tested,  if  dielectric  strength  is  lower  than  specified,  oil \nshould be filtered. While taking oil samples normal precautions should be followed. \nIf  water  is  found  an  investigation  of  the  cause  should  done  and  a  remedial  action \nshould be taken. \n‚Ä¢ All  insulating  parts  should  be  thoroughly  cleaned  to  remove  all  traces  of  carbon \nwhich may remain after the oil has been drained from the tank. \n‚Ä¢ Check the functioning of the breaker through devices which will have to function on \nfault or overload. \n‚Ä¢ Check indicating devices such as mechanical ON and OFF indication, as an incorrect \nindication may at some times lead to a fatal accident. \n‚Ä¢ Check auxiliary switches for c'),
('pranjal', 63, 'n on \nfault or overload. \n‚Ä¢ Check indicating devices such as mechanical ON and OFF indication, as an incorrect \nindication may at some times lead to a fatal accident. \n‚Ä¢ Check auxiliary switches for cleanliness and correct contact making. \n‚Ä¢ If  a  CB  operate  under  fault  conditions  to  interrupt  a  fault,  then  maintenance  after \nsuch  occurrences  should  be  carried  out  giving  special  attention  to  the  following \nitems: \no Current   carrying   parts:   All   contacts   including   isolator   contacts   should   be \nexamined, dressed or replaced if necessary. \no Insulation should be cleaned to remove carbon deposits. Examination to be made \nof cracks, tracking or other damages. \no Arc control devices should be checked and dismantled, if any carbon or metallic \ndeposits are found, these should be removed. \no All joints and seal should be examined for tightness. \no Oil should be checked in case of oil circuit breaker. \no The general inspection for any mechanical damage or '),
('pranjal', 64, 'ound, these should be removed. \no All joints and seal should be examined for tightness. \no Oil should be checked in case of oil circuit breaker. \no The general inspection for any mechanical damage or distortion of the structure \nand  mechanism  should  be  made.  The  switch  gear  should  be  closed  and  tripped \nby each of the methods provided. \n \n2.7.3    Air Break Switch/ Isolators \n \nThe  ease  of  maintenance  is  mainly  a  question  of  access.  This  is  influenced  by  the \nmethod  of  mounting.  Isolators  mounted  upside  down, or  with  their  insulators  horizontal \noften present access problem. During maintenance insulators are cleaned with lintless cloth \nslightly soaked in gasoline. The conditions of all contacts are checked and on detecting any \ntrace  of  burning,  defective  contacts  are  cleaned  or  replaced  with  new  ones.  Old  grease  is \nwashed from the insulation rubbing the part with kerosene and a thin layer of fresh grease is \napplied.  Loose  bolts  a'),
('pranjal', 65, 'ctive  contacts  are  cleaned  or  replaced  with  new  ones.  Old  grease  is \nwashed from the insulation rubbing the part with kerosene and a thin layer of fresh grease is \napplied.  Loose  bolts  and  nuts  are  tightened  at  all points.  The  operating  mechanism  of \nisolator  is  checked  by  closing  and  opening  each  isolator  several  times  with  the  line  de-\nenergized. \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n17 \nWhen  adjusting  the  mechanical  part  of  3  phase  isolators,  the  switch  blades  are \nchecked  for  simultaneous  closing  isolator  blades  are  checked  for  ease  of  engagement  with \nfixed contact jaws. \n \nIsolator  contacts  must  make  a  close  fit  in  order  to  avoid  excessive  heating  when \nclosed.  This'),
('pranjal', 66, 'ng  isolator  blades  are  checked  for  ease  of  engagement  with \nfixed contact jaws. \n \nIsolator  contacts  must  make  a  close  fit  in  order  to  avoid  excessive  heating  when \nclosed.  This  is  checked  by  feeler  gauge  of  0.05mm  (10mm  wide).  Contact  springs  are \nchecked  both  in  compressed  and  free  state.  Contact surface  are  coated  with  acid  free \npetroleum jelly containing minute quantity of graphite. \n \n2.8 MAINTENANCE PROFORMA \n \n2.8.1    Daily Maintenance Proforma   \n \nSTATION:         LOCATION:      DATE: \n \nItems  Work to be done Work done/ Remark if any  \nSwitch yard \n \nAll    jumpers    & \nother connections \nCheck visually for flash/ spark \nmarks  \n \n Transformer \nTR - 1 TR - 2 \nTemperature Check oil temperature during \npeak load hours. Check \nambient temperature \n  \n \nTank Check for oil leakage    \n Dehydrating \nbreather  \nCheck visually colour of   \nsilica gel   \n  \nControl Panel Room \n Relays Check visually target position   \n MCCB/Fuse Check '),
('pranjal', 67, 't temperature \n  \n \nTank Check for oil leakage    \n Dehydrating \nbreather  \nCheck visually colour of   \nsilica gel   \n  \nControl Panel Room \n Relays Check visually target position   \n MCCB/Fuse Check for overheating  \n Load (amp.) Check against rated figure  \n Voltage Check against rated figure  \n PF meter Monitor the PF  reading  \nCapacitor Bank \n All connections Check visually for flash/ spark \nmarks  \n \n \n \n \nSignature of supervisor      Signature of operator/ technician  \n \n \nSignature of in-charge \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n18\n2.8.2    Monthly Maintenance Proforma   \n \nSTATION:        LOCATION:      DATE:\n \n \nNote: In addition to daily maintenance, carry out following works:  \n \nItems  W'),
('pranjal', 68, 'on           \n                   \n18\n2.8.2    Monthly Maintenance Proforma   \n \nSTATION:        LOCATION:      DATE:\n \n \nNote: In addition to daily maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark if any  \nSwitch yard \nCleaning   \n \nEarth pits  \nWatering  \n \nEarth \nconnections \nCheck all connections both at \nearth pits and metal parts \n \n \nYard Growth of unwanted shrubs,     \ngarbage etc.  Keep the yard free    \nfrom shrubs, garbage etc. \n \n Transformer \nTR - 1 TR - 2 \n Buchholz Relay Check gas collection   \nOil level  Check oil level in conservator     \nConnections Open terminal box cover and \ncheck connections visually for \nflash/ spark marks  \n  \nCheck air passages   \n \nDehydrating \nbreather  \nCheck colour of silica gel   \n Cleaning Clean entire transformer \nexternally \n  \nControl Panel Room \n Load (amp.) Check load balancing. If found \nunbalance, distribute the load \nequally on all phases \n \n MCCB/Fuse Provide proper size of \nMCCB/Fuse according '),
('pranjal', 69, 'former \nexternally \n  \nControl Panel Room \n Load (amp.) Check load balancing. If found \nunbalance, distribute the load \nequally on all phases \n \n MCCB/Fuse Provide proper size of \nMCCB/Fuse according to load \ncondition \n \n \n \n \n \nSignature of supervisor      Signature of operator/ technician  \n \n \n \nSignature of in-charge \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n19 \n2.8.3    Quarterly Maintenance Proforma   \n \nSTATION:         LOCATION:      DATE:\n \n \nNote: In addition to monthly maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark if any  \nSwitch yard \n \nSupport \nInsulators \nClean and examine for cracks   \n \nLightning \narresters \nClean and check line and earth \nconnection \n \nClean and lubricate for proper \noperation \n'),
('pranjal', 70, 'e/ Remark if any  \nSwitch yard \n \nSupport \nInsulators \nClean and examine for cracks   \n \nLightning \narresters \nClean and check line and earth \nconnection \n \nClean and lubricate for proper \noperation \n \n \nAB switch \nCheck line and earth connection  \n \nJumpers Check and tighten all jumpers  \n \nHT bus bars \nExamine and tighten bus-bar \nexpansion joints etc.  \n \n Transformer \nTR - 1 TR - 2 \nClean and examine for cracks    Bushing  \nCheck for oil seepage   \nControl Panel Room \n LT Bus bars \nClean and check visually for \noverheating, flash/ spark marks. \nTighten all connections.  \n \n \n \n \n \nSignature of supervisor      Signature of operator/ technician  \n \n \n \n \nSignature of in-charge \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n      '),
('pranjal', 71, '              CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n20\n2.8.4    Half Yearly Maintenance Proforma   \n \nSTATION:        LOCATION:       DATE:\n \n \nNote: In addition to quarterly maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark if \nany  \n Transformer \nTR - 1 TR - 2 \n Oil Check BDV, if BDV < 30 \nkV/cm, do filtration to restore \nquality of oil. \n  \n Cable box, \ngasketed    joints \nand gauges  \nInspect for leakage and cracks \n  \nControl Panel Room \n \nOCB1 OCB2 OCB3 OCB4 OCB5 \nCheck oil level in the tanks.  \n     \nTest  the  oil,  if  shows  signs  of \nmoisture,  carbonization  or  dirt. \nFilter or replace if necessary. \n     \nCheck all valves for oil leakage. \n     \n \nOil circuit \nbreakers \nCheck    the    condition    of    all \ngaskets    provided    to    prevent \nentrance  of  water  and  leaka'),
('pranjal', 72, 'ace if necessary. \n     \nCheck all valves for oil leakage. \n     \n \nOil circuit \nbreakers \nCheck    the    condition    of    all \ngaskets    provided    to    prevent \nentrance  of  water  and  leakage  of \noil. \n     \n \nACB 1 ACB 2 ACB 3 ACB 4 ACB 5 \nClean with lint free cloth      \nClean fixed and moving contacts          \n \nACB \nClean   and   lubricate   operating \nmechanism \n     \n \n \n \n \nSignature of supervisor      Signature of operator/ technician  \n \n \n \nSignature of in-charge \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n21 \n2.8.5    Yearly Maintenance Proforma  \n  \nSTATION:        LOCATION:      DATE: \n \nNote: In addition to half yearly maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark if any  \nSwitch yard \n \n'),
('pranjal', 73, 'nce Proforma  \n  \nSTATION:        LOCATION:      DATE: \n \nNote: In addition to half yearly maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark if any  \nSwitch yard \n \nConcreting/ \ncoping of the \nsupports \nTake preventive action, if there are cracks \nor the coping of concreting is coming off. \n \n \nGravel/crus\nhed rock \n \nCheck    leveling,    oil    stain    and    dust \naccumulation.  Spray  water  to  remove  oil \nstain  and  accumulated  dust.    Maintain \nleveling   to   avoid   formation   of   water \npools. \n \n \nEarth \nresistance \nMeasure the earth resistance of individual \nequipment earth pit   \n Major sub-station     : 1.0 ohms \n Small sub-station      : 2.0 ohms \n \n Earth \nconnection of \nmetal parts \nCheck the earth connection of metal parts \nis properly connected to the earth. \n \nCheck the line and earth connections    AB switches \nLubricate and check proper operation    \nMeasure  IR  value  between  HV  terminal \nand earth, if low, replace i'),
('pranjal', 74, 'roperly connected to the earth. \n \nCheck the line and earth connections    AB switches \nLubricate and check proper operation    \nMeasure  IR  value  between  HV  terminal \nand earth, if low, replace it. \n  HT \nlightning \narresters \nCheck the line and earth connection   \n Bus-bars Tighten  the  connections  properly  from \nthe bus bars and bars to the lines \n \n Insulators Clean  and  check  all  insulators  for  any \ncrack or damage. Change if required \n \nTransformer \nTR - 1 TR - 2 \n Winding Measure IR value between  \nHV-Earth                                              \nHV-LV                    Min. 2M ohm/ kV \nLV-Earth \nIf low, take corrective action  \n  \n  \nCheck BDV, if < 30 kV/cm, do filtration \nto restore quality of oil. \n   Oil \n \n \nPerform dissolve gas analysis (DGA) as \nper annexure - B  to check for incipient \nfaults \n  \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1'),
('pranjal', 75, 're - B  to check for incipient \nfaults \n  \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n22\nItems  Work to be done Work done/ Remark if any  \nClean and check components of floats, \nalarm contacts and their operation. \nReplace if necessary\n \n   Buchholz \nrelay \nCheck accuracy of relay. Change the \nsetting, if necessary. \n  \n Earth \nresistance \nCheck earth resistance of neutral and \nbody.  If high, take corrective action \n  \n Body Check for peelings/ rusting/ damage. \nRepaint, as required \n  \n \n \nSignature of supervisor      Signature of operator/ technician  \n \n \nSignature of in-charge \n \n2.8.6    5 Yearly Maintenance Proforma   \n \nSTATION:         LOCATION:       DATE:\n \n \nNote: In addition to yearly maintenan'),
('pranjal', 76, 'isor      Signature of operator/ technician  \n \n \nSignature of in-charge \n \n2.8.6    5 Yearly Maintenance Proforma   \n \nSTATION:         LOCATION:       DATE:\n \n \nNote: In addition to yearly maintenance, carry out following works:  \n \nItems  Work to be done Work done/ Remark \nif any  \nSwitch yard \n \nGravel/crushed \nrock \n \nCheck   condition,   up   layer   and   size. \nRemove  rounded  pieces  and  muck  by \nscreening.  Maintain      up  layer  of  100 \nmm   by   additional   quantity   of   size \n40mm \n \nTransformer \nTR - 1 TR - 2 \n Core and \nwindings \nOverall inspection including lifting of \ncore and coils. Wash with clean dry oil. \n  \n Rollers Examine carefully during overhauling \nand grease them properly \n  \nControl Panel \n Circuit breaker Overhaul every circuit breaker    \n  \n \nSignature of supervisor      Signature of operator/ technician  \n \n \nSignature of in-charge \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                '),
('pranjal', 77, 'ure of supervisor      Signature of operator/ technician  \n \n \nSignature of in-charge \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n23 \nCHAPTER 3 \n \nTROUBLE SHOOTING \n \n \n\nFailure of equipment in  Substation is not a sudden phenomenon, for that matter  each \nand  every  failure  will  take  place  only  after  alerting  through  some  pre-signs.  If  they  went \nunnoticed  or  unattended  will  results  into  a  failure.  Therefore  it  is  wise  on  the  part  of  the \nmaintenance  personnel  to  act  upon  the  pre  failure  signs  noticed  well  in  advance  to  keep  the \nequipment failure free and serviceable at all times.\nIf new equipment is installed for which there is no past experience, it will be difficult \nto forecast the defects and probable'),
('pranjal', 78, 'ce  to  keep  the \nequipment failure free and serviceable at all times.\nIf new equipment is installed for which there is no past experience, it will be difficult \nto forecast the defects and probable failures. Further if a failure occurred even though all the \nknown precautions were observed, then it is necessary and more advantageous to investigate \ninto the failure in such a manner to pull out the actual reasons of failure so that action shall be \ninitiated to avoid recurrence.\n \n3.1 AN APPROACH TO EQUIPMENT FAILURE INVESTIGATION \n \n3.1.1    On Failure Aspects \n1. Occurrence \n2. Date of occurrence \n3. Past similar occurrences if any \n4. Analysis of failure i.e. why did it happen? \n5. Whether the rate of failure is worse than other installations? \n \n3.1.2    On Maintenance Aspects \n1. Whether  schedule  maintenance  &  required  testing  have  been  carried  out  on  the  failed \nequipment as per norms stipulated? \n2. Does the frequency of maintenance require change? \n3. Was the wor'),
('pranjal', 79, 'hether  schedule  maintenance  &  required  testing  have  been  carried  out  on  the  failed \nequipment as per norms stipulated? \n2. Does the frequency of maintenance require change? \n3. Was the work properly supervised? \n4. Was any RDSO modification required to be done? \n5. Is any modification possible to avoid failure? \n \n3.1.3    About Staff \n1. Is the quality of work done satisfactorily? \n2. Is the skilled staff properly trained to carry out the work? \n3. Is the SMI available with them? \n4.  Are proper tools available with the staff? \n \n3.1.4    About Material  \n1. Is the material received from approved source? \n2. Whether the material is as per approved specification? \n3. Can a better material be used? \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Servi'),
('pranjal', 80, '                                               CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n24\n3.1.5    About Testing  \n1. Is the testing equipment available? \n2. Could testing procedure be improved to weed out the failures? \n3. Whether testing equipment are calibrated? \n \n3.1.6    General Points \nWhether following points were checked / performed properly?  \n1. Proper contact \n2. Clearances \n3. Capacity \n4. Proper contact pressure \n5. Crack detections \n6. Cleaning \n7. Proper connections/alignment \n8. Cross checks/super checks \n \n3.1.7    Any other Findings not covered in the above \n\n3.2 CAUSES OF FAILURES AND THEIR REMEDIES  \n \n3.2.1    Common Failures of Transformer \n \nSome of the common failures/ defects occurred in transformer are as under: \n Oil leakage \n Low BDV \n Bushing failure \n Winding failures \n Excessive overheating '),
('pranjal', 81, ' Common Failures of Transformer \n \nSome of the common failures/ defects occurred in transformer are as under: \n Oil leakage \n Low BDV \n Bushing failure \n Winding failures \n Excessive overheating of oil \n Low IR value \n Humming sound \n  \n Oil leakage \n \nLocation Possible causes Remedial action \nFrom screw \njoints \n÷æ Foreign material in threads \n÷æ Poor threads \n \n÷æ Improper assembly \n÷æ Remove the foreign material. \n÷æ Check the threads & replace if \nrequired.  \n÷æ Ensure proper assembly. \nFrom gasket \njoints \n÷æ Insufficient or uneven \ncompression. \n÷æ Improper preparation of gaskets \nand gasket surfaces. \n÷æ Old gaskets \n÷æ Tight gasket joints uniformly. \n \n÷æ Provide proper gaskets. \n \n÷æ Provide new gaskets. \nFrom weld \njoints \n÷æ Shipping strains, imperfect weld. ÷æ Repair welds following proper \nprocedure. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Mai'),
('pranjal', 82, 'proper \nprocedure. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n25 \n \nLocation Possible causes Remedial action \nFrom \ncouplings & \ntheir joints \n÷æ Cracks in couplings. \n \n \n \n÷æ Defective coupling joints. \n÷æ Replace couplings and secure \nthe pipe lines near couplings \nproperly. \n÷æ Make proper coupling joints \nand tight the screws. \nFrom drain \nplugs. \n÷æ Defective thread portion.  \n÷æ Defective oil seal. \n÷æ Check the threaded portion. \n÷æ Replace the oil seal and tight \nthe drain plug. \n \n Low BDV \n \nType of failure\n Possible causes Remedial action \nMoisture   contamination   in \ntransformer     oil     due     to \ninactive    silica    gel    (pink \ncolour). \nReactivate    silica    gel    crystals    or \nreplace  them.  Purify  the  transformer \noil to re'),
('pranjal', 83, 'contamination   in \ntransformer     oil     due     to \ninactive    silica    gel    (pink \ncolour). \nReactivate    silica    gel    crystals    or \nreplace  them.  Purify  the  transformer \noil to restore dielectric strength. \nLeaks around cover \naccessories,    breathing    air \nfrom leaks. \nAttend    leaks,    replace    gasket    if \nnecessary.  Purify  the  transformer  oil \nto restore dielectric strength. \nLow BDV \nHumid  atmosphere  in  rainy \nseason. \nPurify  the  transformer  oil  to  restore \ndielectric   strength   and   check   the \nBDV & water content. \n \n Bushing Failure \n \nTypes of failure Possible causes Remedial action \nH V Bushing \nflash over \n-    Lightening discharge \nor over voltage \n \n÷æ Dirty bushing. \n \n÷æ It  may  be  a  break  in  the  turns  or \nend  lead,  flash  marks  on  the  end \ncoil and earthed parts close to it. \n÷æ Ensure    cleaning    of    porcelain \nbushing during each inspection. \nH V Bushing \nporcelain \ninsulator petticoat \nbroken / cracked. \n÷æ E'),
('pranjal', 84, ' marks  on  the  end \ncoil and earthed parts close to it. \n÷æ Ensure    cleaning    of    porcelain \nbushing during each inspection. \nH V Bushing \nporcelain \ninsulator petticoat \nbroken / cracked. \n÷æ External hitting. ÷æ Ensure    proper    cleaning    and \nvisual    checking    of    porcelain \nbushing during each inspection. \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n26\n Winding Failures \n \nTypes of failure Possible causes Remedial action \nPrimary winding \nlead open circuited \n/ earthed. \nDue to overload \nor brazing \nfailure. \nCheck  the  winding  in  one  or  all  phases \nwould   show   signs   of   overheating   and \ncharring.  \nBulging  and  inter \nturn   short,   inter \nlayer short or \ninter coils sho'),
('pranjal', 85, 'brazing \nfailure. \nCheck  the  winding  in  one  or  all  phases \nwould   show   signs   of   overheating   and \ncharring.  \nBulging  and  inter \nturn   short,   inter \nlayer short or \ninter coils short. \nCoils shrink and \nin between \ninsulation failure.\n \n Investigate   for   over   loading   and   take \ncorrective action accordingly.  \nShorting between \nLV and HV coils. \n \nInsulation \nfailure.  \n \nDuring   manufacturing/   rewinding   of   the \ntransformer,   the   coils   should   be   pressed \ndown, heated and cooled repeatedly until the \ncoil height stabilizes. \nFlash mark on the \ncore and support. \n \nDead short- \ncircuit    due    to \nlateral or \ndisplacement   of \nthe coil.  \n \n-   Winding \nloose on the \ncore. \n-  Nomex  paper  insulation  sheet  should  be \nprovided  between  H.V.  &  L.V.  coils  so \nas   to   strengthen   the   insulation   level. \nEnsure that this insulation sheet does not \ncause  any  obstruction  in  the  passage  of \noil flow. \n-  Replace  the  transforme'),
('pranjal', 86, ' &  L.V.  coils  so \nas   to   strengthen   the   insulation   level. \nEnsure that this insulation sheet does not \ncause  any  obstruction  in  the  passage  of \noil flow. \n-  Replace  the  transformer  and  core  to  be \nlifted  for  thoroughly  checking  and  take \ncorrective action accordingly. \n- Repair the winding if possible \n  \n Excessive overheating of transformer \n \nType of failure Possible causes Remedial action \n-  Any internal fault \nsuch as short \ncircuited core, core \nbolts/ clamps \ninsulation failure etc. \n \n÷æ Replace  the  transformer  and  core  to \nbe   lifted   for   thoroughly   checking. \nTake  corrective  action  according  to \nobservations and oil test report. \n÷æ   Low    oil    level    in \nconservator. \n÷æ Check  the  oil  level  in  conservator \nand top up if required. \nTemperature \nrise of \ntransformer oil. \n÷æ Slugged oil. \n \n÷æ Overloading \n÷æ Carry   out   purification   of   oil   to \nremove sludge. \n÷æ Adjust the load \n \n\nCAMTECH/ E/11-12/Sub-station/1.0    '),
('pranjal', 87, 'ired. \nTemperature \nrise of \ntransformer oil. \n÷æ Slugged oil. \n \n÷æ Overloading \n÷æ Carry   out   purification   of   oil   to \nremove sludge. \n÷æ Adjust the load \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n27 \n Low IR value \n \nType of failure Possible causes Remedial action \nLow IR value ÷æ    Moisture in oil. ÷æ Purify the oil with high vacuum type oil \npurification plant and test the oil for \nelectrical strength and water content. \n÷æ Insulation   failure \nbetween   winding \nand core. \n÷æ Replace  the  transformer.  Lift  the  active \npart and check the winding thoroughly for \ninsulation   damage   and   take   corrective \naction accordingly. \n \n÷æ Internal connection \nleads insulation \ndamage. \n÷æ Weak brazing \n÷æ Check  the  internal  connection  leads  b'),
('pranjal', 88, 'ing thoroughly for \ninsulation   damage   and   take   corrective \naction accordingly. \n \n÷æ Internal connection \nleads insulation \ndamage. \n÷æ Weak brazing \n÷æ Check  the  internal  connection  leads  by \nlifting    the    active    part    and    re-tape \ninsulation paper of damaged portion. \n÷æ Clean the joint and braze properly. \n \n Humming sound \n \nType of failure\n Possible causes Remedial action \n÷æ Loose core ÷æ Lift the active part and tight all the \npressure bolts and clamping bolts. \nHumming \nsound \n÷æ Winding loose \ndue  to  shrinkage \nof coils. \n÷æ During  manufacturing/  rewinding  of  the \ntransformer,  the  coils  should  be  pressed \ndown, heated and cooled repeatedly until \nthe coil height stabilizes. \n÷æ The   winding   pressure   bolts   and   core \nclamping    bolts    should    be    tightened \nduring the first POH after \ncommissioning to take care of shrinkage. \n  \n3.3 INVESTIGATION INTO CAUSES OF FAILURES OF TRANSFORMER \n \nIn  most  cases  the  causes  of  the  fault  ca'),
('pranjal', 89, '  be    tightened \nduring the first POH after \ncommissioning to take care of shrinkage. \n  \n3.3 INVESTIGATION INTO CAUSES OF FAILURES OF TRANSFORMER \n \nIn  most  cases  the  causes  of  the  fault  can  be  surmised  by  careful  observation  of  the \ncondition  of  windings,  e.g.  displacement  of  the  turns  or  coils,  coil  insulation  (brittle  or \nhealthy),  evidence  of  overheating,  carbon  deposit  or  flash  marks  on  the  core,  supports,  the \ninner  surface  of  the  tank  or  cover.  The  following  notes  may  be  helpful  in  identifying  the \ncauses: \n \n3.3.1    Failure due to Lightening Discharge or Over Voltages \n   \nThis is characterized by break down of the end turns close to the line terminal. There may be \na break in the turns or end lead, and also flash marks on the end coil and earthed parts close \nto it, but the rest of the coils will be found to be healthy. \n \n3.3.2    Sustain Overloads \n \n  The  windings  in  one  or  all  phases  would  show  signs  of '),
('pranjal', 90, ' the end coil and earthed parts close \nto it, but the rest of the coils will be found to be healthy. \n \n3.3.2    Sustain Overloads \n \n  The  windings  in  one  or  all  phases  would  show  signs  of  overheating  and  charring;  the \ninsulation would be very brittle and would have lost all its elasticity. \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n28\n3.3.3    Inter-turn short, Inter-layer short, or Inter coils short \n \n  The  same  signs  as  for  indicated  for  sustained  over  load  would  be  noticed,  but  only  on \naffected  coils, the rest of the coils being intact. This is likely if the differential relay or the \nBuchholz relay has operated. \n \n3.3.4    Dead Short-circuit  \n \nThis  can  be  identi'),
('pranjal', 91, 't  only  on \naffected  coils, the rest of the coils being intact. This is likely if the differential relay or the \nBuchholz relay has operated. \n \n3.3.4    Dead Short-circuit  \n \nThis  can  be  identified  by  the  unmistakable,  lateral  or  axial  displacement  of  the  coils.  The \ncoils may be loose on the core, some turns on the outermost layer may have burst outwards \nand  broken  as  if  under  tension.  If,  in  addition  to these  signs,  the  windings  are  also \ncompletely  charred,  it  is  conclusive  evidence  that the  short  circuit  has  continued  for  an \nappreciable period, not having been cleared quickly by the protective relays. \n \n3.3.5 Buchholz Relay Tripping \n \nIf  the  upper  chamber  of  the  Buchholz  relay  alone  has  tripped,  check  the  insulation  of  core \nbolts,  by  applying  a  voltage  of  230V  to  1000V  between  the  core  and  each  bolt.  If  it  fails, \nrenew  the  insulating  bush.  Observe  also  all  the  joints,  and  tap-changer  contac'),
('pranjal', 92, ' \nbolts,  by  applying  a  voltage  of  230V  to  1000V  between  the  core  and  each  bolt.  If  it  fails, \nrenew  the  insulating  bush.  Observe  also  all  the  joints,  and  tap-changer  contacts,  for  over-\nheating and arcing. \n \n3.3.6 Internal Flashover \n \nIf  the  oil  shows  a  low  BDV,  it  does  not  necessarily  mean  it  has  caused  the  breakdown.  At \nhigh  voltage  ratings,  excessive  moisture  content  in  the  oil  may  result  an  internal  flashover \nbetween the live parts and earth, which all leave corresponding tell tale marks. \n \n3.4 DO‚Äôs & DON\'Ts \n \n3.4.1   Do‚Äôs \n \n1. Ensure all safety arrangement while working on electrical installation. \n2. Ensure that all tools & tackles are in good & working condition. \n3. Check and thoroughly investigate the transformer whenever any alarm or protection \nis operated. \n4. Check the protection system periodically. \n5. Ensure every employee is familiar with the instructions for restoration of persons \nsuffering from elect'),
('pranjal', 93, 'henever any alarm or protection \nis operated. \n4. Check the protection system periodically. \n5. Ensure every employee is familiar with the instructions for restoration of persons \nsuffering from electric shock.\n \n6. Trained the staff in operating the fire-fighting equipment. \n7. Always avoid un-balance loading on phase. \n8. Do earthing of all points before starting maintenance. \n9. Keep all spares away from dirt. \n10. Work with full confidence. \n11. Ensure thorough and full cleaning of insulators, since partial cleaning is worse than \nno cleaning.  \n12. Ensure perfect isolation of supply before commencement of maintenance work. \n13. Put a caution board when on work.   \n \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n29 \n3.4.2    Don‚Äôts \n1. Don‚Äôt use low ');
INSERT INTO `chunks` (`adminid`, `chunkid`, `chunk`) VALUES
('pranjal', 94, '                                            \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n29 \n3.4.2    Don‚Äôts \n1. Don‚Äôt use low capacity lifting jacks on transformer. \n \n2.  Don‚Äôt leave circuit tap switch unlock. \n \n3.  Don‚Äôt leave any loose connection. \n \n4.  Don‚Äôt meddle with protection system. \n \n5.  Don‚Äôt allow conservator oil level to fall below minimum level mark of indicator. \n \n6.  Don‚Äôt parallel transformers which do not full fill the necessary requirement. \n \n7.  Don‚Äôt allow unauthorised entry in the sub-station. \n \n8.  Don‚Äôt overload the transformer other than the specified limit mentioned. \n \n9.  Don‚Äôt tight the nuts & bolts in excess to arrest any leakage. \n \n10. Don‚Äôt avoid any unusual noise/occurrence noticed in the substation.. \n \n11. Never use fuses higher than the prescribed ratings on HT and LT sides.  \n \n12. Earthing  connections  should  never  be  done  in  loose manner.  Simply  twisting  of '),
('pranjal', 95, 'ticed in the substation.. \n \n11. Never use fuses higher than the prescribed ratings on HT and LT sides.  \n \n12. Earthing  connections  should  never  be  done  in  loose manner.  Simply  twisting  of  GI \nwires would be dangerous. The earthing connections should as far as possible be done \nby  using  continuous  wire  or  providing  suitable  connectors.  It  should  be  ensured  that \nthese connections are tightened rigid. \n \n13. Never keep the breather pipe open or exposed. \n \n14. Don‚Äôt ignore safety rules during maintenance work. \n \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n30\n \nChapter 4 \n \nEARTHING \n \n \nProvision  of  adequate  earthing  in  a  substation  and switching  stations  are  very \nimportant'),
('pranjal', 96, 'ectrical General Services Sub-station           \n                   \n30\n \nChapter 4 \n \nEARTHING \n \n \nProvision  of  adequate  earthing  in  a  substation  and switching  stations  are  very \nimportant for the safety of operating personnel as well a electrical devices do not rise above \ntolerable thresholds and that the earth connection is rugged to dissipate the fault to the earth. \nThe  importance  of  an  effective,  durable  and  a  dependable  earth  for  ensuring  safety  from \nelectrical hazards does not require to be elaborated upon more. By earthing, connecting the \nelectrical equipment to the general mass of the earth, this has a very low resistance. \n \n4.1 PURPOSE OF SUBSTATION EARTHING SYSTEM \n \nThe object of an  earthing system in  a substation  is to provide under and  around the \nsubstation  a  surface  that  shall  be  at  a  uniform  potential  and  near  zero  or  absolute  earth \npotential as possible. The provision of such a surface of uniform potential under and aro'),
('pranjal', 97, 'the \nsubstation  a  surface  that  shall  be  at  a  uniform  potential  and  near  zero  or  absolute  earth \npotential as possible. The provision of such a surface of uniform potential under and around \nthe substation ensure that no human being in the substation subject in shock of injury on the \noccurrence of a  short circuit or development of other abnormal conditions in the equipment \ninstalled in the yard. \n \nThe primary requirements of a good earthing system in a substation are: \na. It is stabilize circuit potentials with respect to ground and limit the overall potential \nrise. \nb. It is protect life and property from over voltage.  \nc. It  is  provide  low  impedance  path  to  fault  currents  to  ensure  prompt  and  consistent \noperation of protective devices during ground faults. \nd. It  is  keep  the  maximum  voltage  gradient  along  the  surface  inside  and  around  the \nsubstation within safe limits during ground fault. \n \n4.2 MAXIMUM PERMISSIBLE RESISTANCE OF EARTHIN'),
('pranjal', 98, 's. \nd. It  is  keep  the  maximum  voltage  gradient  along  the  surface  inside  and  around  the \nsubstation within safe limits during ground fault. \n \n4.2 MAXIMUM PERMISSIBLE RESISTANCE OF EARTHING SYSTEM \n Large power station          :   0.5 ohms. \n Major sub-station    :  1.0 ohms. \n Small sub-station    :  2.0 ohms. \n In all other cases    :   8.0 ohms. \n The earth continuity inside an installation    :  1.0 ohms. \n  \n  \n4.3 TOUCH VOLTAGE (E TOUCH) \n \nThe  potential  difference  between \na ground metallic structure and a point on \nthe earth‚Äôs surface separated by a distance \nequal  to  the  normal  maximum  horizontal \nreach   of   a   person,   approximately   one \nmeter as shown in figure. \n \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n3'),
('pranjal', 99, '                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n31 \n4.4 STEP VOLTAGE (E STEP) \n \nThe potential difference \nbetween   two   points   on   the   earth \nsurface  separated  by  distance  of  one \npace  that  will  be  assumed  to  be  one \nmeter  in  the  direction  of  maximum \npotential    gradient    as    shown    in \nfigure. \n \n \n \n4.5 EARTHING SYSTEM IN SUB STATION \n \nThe  earthing  system  comprises  of  earthing  (or)  grid,  earthing  electrodes,  earthing \nconductors and earth connections.  \n \n4.5.1    Earth Mat or Grid \n \nThe  primary  requirement  of  earthing  is  to  have  a  very  low  earth  resistance.  If  the \nindividual electrodes driven in the soil are measured it will have a fairly high resistance. But \nif these individual electrodes area inter linked inside the soil, it increases the area in constant \nwith soil and cr'),
('pranjal', 100, 'trodes driven in the soil are measured it will have a fairly high resistance. But \nif these individual electrodes area inter linked inside the soil, it increases the area in constant \nwith soil and creates a number or paralleled paths and hence the value of earth resistance in \nthe  interlink  state,  which  is  called  combined  earth resistance,  will  be  much  lower  than  the \nindividual resistance. \n \nHowever  interlinking  of  earth  pit  electrodes  is  necessary.  The  sub-station  involves \nmany  earthing  through  individual  electrodes.  In  order  to  have  uniform  interconnection,  a \nmat or grid or earthing conductor is formed inside the soil. Thus a mat is spread underneath \nthe sub-station. Hence if a ground electrode is driven in the soil, the interlinking can be done \nby a small link between that electrode and earth mat running nearby. The spreading of such \na  mat  in  the  soil  also  ensures  the  object  of  earthing  that  and  surface  under  and  around  the '),
('pranjal', 101, 'y a small link between that electrode and earth mat running nearby. The spreading of such \na  mat  in  the  soil  also  ensures  the  object  of  earthing  that  and  surface  under  and  around  the \nsub-station is kept at as nearly absolute earth potential as possible. \n \n4.5.2    Construction of Earth Mat \n \nThe sub-station site including the fence is segregated at intervals, of say four meters \nwidth along with length and breadth wise. Trenches of one meter to 1.5 meter depth and one \nmeter width is dug along these lines. The earthing conductors of sufficient sizes (as per fault \ncurrent)  are  placed  at  the  bottom  of  these  trenches.  All  the  crossing  and  joints  are  braced. \nThe trenches are then filled up with soil of uniform fine mass of earth mixed with required \nchemicals depending upon the soil resistivity.  \n \nIf  location  of  equipment  is  fixed,  the  intervals  are  also  arranged  that  the  earth  mat \npasses nearby the equipment location to facilitate for '),
('pranjal', 102, 'ls depending upon the soil resistivity.  \n \nIf  location  of  equipment  is  fixed,  the  intervals  are  also  arranged  that  the  earth  mat \npasses nearby the equipment location to facilitate for easy interlinking. \n \nIt is preferable to extend the mat beyond the fence for about one meter that fence can \nalso be suitably earthed and made safe for touching. \n \nNormally the earth mat is buried horizontally at a depth of about half a meter below \nthe surface of the ground and ground rods at suitable points. \n \n   \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n32\n4.5.3    Earth Mat in a Sub-Station \n \nEarth Mat is connected to the Following in a Sub-Station: \n‚Ä¢ The neutral point of such system through its own '),
('pranjal', 103, 'ices Sub-station           \n                   \n32\n4.5.3    Earth Mat in a Sub-Station \n \nEarth Mat is connected to the Following in a Sub-Station: \n‚Ä¢ The neutral point of such system through its own independent earth. \n‚Ä¢ Equipment   frame   work   and   other   non-current   carrying   parts   of   the   electrical \nequipments in the sub-station. \n‚Ä¢ All extraneous metallic frame work not associated with equipment. \n‚Ä¢ Handle of the operating pipe. \n‚Ä¢ Fence if it is within 2 m from earth mat. \n  \n4.6 LOCATION OF EARTH ELECTRODE \n \nThe location of earth electrode should be chosen in one of the following types of soil \nin the order of preference given on next page \n‚Ä¢ Wet marshy ground. \n‚Ä¢ Clay, loamy soil and arable land \n‚Ä¢ Clay and loam mixed with varying proportions of sand, gravel and stones. \n‚Ä¢ Damp and wet sand, peat. \nDry sand, gravel chalk limestone, granite, very stone ground and all locations where \nvirgin rock is very close to the surface should be avoided. \n \n4.6.1    Pipe Elec'),
('pranjal', 104, 'es. \n‚Ä¢ Damp and wet sand, peat. \nDry sand, gravel chalk limestone, granite, very stone ground and all locations where \nvirgin rock is very close to the surface should be avoided. \n \n4.6.1    Pipe Electrode \n \nIt should be made of ‚ÄòB‚Äô class G.I pipe. The internal diameter should not be smaller \nthan  38  mm  and  it  should  be  100  mm  fore  cast  Iron  pipe.  The  length  of  the  pipe  electrode \nshould  not  less  than  2.5  m.  It  should  be  embedded  vertically.  Where  hard  rock  is \nencountered  it  can  be  inclined  to  vertical.  The  inclination  shall  not  more than  30\n0\n  from  the \nvertical.   \n \nTo  reduce  the  depth  of  burial  of  an  electrode  without  increasing  the  resistance,  a \nnumber  of  pipes  shall  be  connected  together  in  parallel.  The  resistance  in  this  case  is \npractically proportional to the reciprocal of the number of electrodes used so long as each is \nsituated outside the resistance area of the other. The distance between two elec'),
('pranjal', 105, 'ce  in  this  case  is \npractically proportional to the reciprocal of the number of electrodes used so long as each is \nsituated outside the resistance area of the other. The distance between two electrodes in such \na case shall preferably be not less than twice the length of electrode as shown in figure 4.1. \n \n4.7 EARTHING OF VARIOUS EQUIPMENT IN THE SUB-STATION \n \n4.7.1    Isolators and switches \n \nA  flexible  earth  conductor  is  provided  between  the handle  and  earthing  conductor \nattached to the mounting bracket and the handle of switches is connected to earthing mat by \nmeans of two separate distinct connections made with MS flat. One connection is made with \nthe  nearest  longitudinal  conductor,  while  the  other  is  made  to  the  nearest  transverse \nconductor of the mat. \n \n4.7.2    Lightning Arrestors \n \nConductors  as  short  and  straight  as  practicable  to ensure  minimum  impedance  shall \ndirectly connect the bases of the lightning arrestors to the earth gri'),
('pranjal', 106, '. \n \n4.7.2    Lightning Arrestors \n \nConductors  as  short  and  straight  as  practicable  to ensure  minimum  impedance  shall \ndirectly connect the bases of the lightning arrestors to the earth grid. In addition, there shall be \nas direct a connection as practicable from the earth side of lightning arrestors to the frame of \nthe equipment being protected. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n33 \nIndividual  ground  electrodes  should  be  provided  for  each  lighting  arrestor  for  the \nreason  that  large  grounding  system  in  itself  may  be  relatively  of  little  use  for  lightning \nprotection. These ground electrodes should be connected to the main earth system. In the case \nof lighting arrestors mounted near transformers, earthing '),
('pranjal', 107, '  relatively  of  little  use  for  lightning \nprotection. These ground electrodes should be connected to the main earth system. In the case \nof lighting arrestors mounted near transformers, earthing conductor shall be located clear off \nthe tank and coolers in order to avoid possible oil leakage caused by arcing. \n \nCHARCOAL LAYER\nSALT LAYER\nALTERNATE LAYER \nOF CHARCOAL OR \nCOKE AND SALT\n500mm\n200mm\n300mm\n500\nGROUND LEVEL\n2500 mm (Min.)\nPIT COVER\n \n  \n \n4.7.3    Circuit Breakers \n \nFor   every   breaker   there    will   be   five   earth connections to the earth mat with \nMS flat (i) breaker body (ii) relay panel (iii) CTs of the breaker (iv) Two side of the breaker \nstructure. \n \n4.7.4    Transformers \n \nThe tank of each transformer shall be directly connected to the main grid. In addition \nthere  shall  be  as  direct  a  connection  as  practicable  from  the  tank  to  the  earth  side  of \nprojecting lightning arrestors. \n \nFigure ‚Äì4.1 Pipe Electrode \n \n\n                        '),
('pranjal', 108, 'ion \nthere  shall  be  as  direct  a  connection  as  practicable  from  the  tank  to  the  earth  side  of \nprojecting lightning arrestors. \n \nFigure ‚Äì4.1 Pipe Electrode \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n34\nThe  transformer  track  rails  shall  be  earthed  either  separately  or  by  bonding  at  each \nend  of  the  track  and  at  intervals  not  exceeding  60.96  meter  (200  feet).  The  earthing  of \nneutral  bushing  shall  be  by  two  separate  strips  to the  earth  grid  and  shall  likewise  be  run \nclear to rank cell and coolers. \n \n4.7.5    Current Transformers and Potential Transformers \n \nThe supporting structures of Current Transformer and Potential Transformer unit of \nbases, '),
('pranjal', 109, 'ise  be  run \nclear to rank cell and coolers. \n \n4.7.5    Current Transformers and Potential Transformers \n \nThe supporting structures of Current Transformer and Potential Transformer unit of \nbases,  all  bolted  cover  plates  to  which  the  bushings  are  attached  connected  to  the  earthing \nmat  by  means  of  two  separate  distinct  connections  made  with  MS  flat.  One  connection  is \nmade  with  the  nearest  longitudinal  conductor,  while  the  other  is  made  to  the  nearest \ntransverse conductor of the mat. \n \n4.7.6    Other Equipment \n \nAll equipment‚Äôs, structures, and metallic frames of switches and isolators shall be \nearthed separately as shown in figure 4.2. \n \n \n4.7.7    Fences \n \nThe  Sub-station  fence  should  be  generally  too  far  outside  the  substation  equipment \nand  grounded  separately  from  the  station  ground.  The  station  and  the  fence  ground  should \nnot be linked. To avoid any risk to the person walking near the fence inside the stat'),
