('pranjal', 111, 'ected to a very high potential under fault conditions.  \n \nIn  a  fence  very  near  to  the  station  area,  high  shock  voltage  can  be  avoided  by \nensuring  good  contact  between  the  fence  stations  and  by  grounding  the  fence  at  intervals. \nThe  station  fence  should  not  be  connected  to  the  station  ground  but  should  be  grounded \nseparately.  If  however,  the  fence  is  close  to  the  metal  parts  of  substation,  it  should  be \nconnected to the station ground. \n \n4.7.8    Ground Wire  \n \nAll ground wires over a station shall be connected to the station earth grid. In order \nthat  the  station  earth  potentials  during  fault  conditions  are  not  applied  to  transmission  line \nground  wires  and  towers,  all  ground  wires  coming  to  the  station  shall  be  broken  at  and \ninsulated on the station side of the first tower or pole external to the station by means of 10‚Äù \ndisc insulator. \nFigure ‚Äì4.2 Structure Earthing \n\nCAMTECH/ E/11-12/Sub-stat'),
('pranjal', 112, 'hall  be  broken  at  and \ninsulated on the station side of the first tower or pole external to the station by means of 10‚Äù \ndisc insulator. \nFigure ‚Äì4.2 Structure Earthing \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n35 \n4.7.9    Cables and Supports \n \nMetal  sheathed  cables  within  the  station  earth  grid  area  shall  be  connected  to  that \ngrid. Multi-core cables shall be connected to the grid at least at one point. Single core cables \nnormally shall be connected to the grid at one point only. Where cables which are connected \nto the station earth grid pass under a metallic station perimeter fence, they shall be laid at a \ndepth of not less than 762 mm (2‚Äô-6‚Äù) below the fence, or shall be enclosed in an insulating \npipe for a distance of not le'),
('pranjal', 113, 'grid pass under a metallic station perimeter fence, they shall be laid at a \ndepth of not less than 762 mm (2‚Äô-6‚Äù) below the fence, or shall be enclosed in an insulating \npipe for a distance of not less than 1524 mm (5‚Äô) on each side of the fence. \n \n4.7.10    Panels and Cubicles \n \nEach  panel  or  cubicle  should  be  provided  near  the  base  with  a  frame  earth  bar  of \ncopper  to  which  shall  be  connected  the  metal  bases and  covers  of  switches  and  contactor \nunit.  The  frame  earth  bar  shall  in  turn  be  connected  to  the  earth  grid  by  an  earthing \nconductor.  \n \n4.8 DISTRIBUTION TRANSFORMER STRUCTURE EATHING \n \n1. For earthing three earth pits in triangular formation at a distance of six meter from each \nother are to be provided.  \n2. Earth pit should be digged for 45 cm x 45 cm size and 5 ft. depth. \n3. 3 Nos. of 40 mm dia and 2.9 mm thickness and 3 mts. (10 ft) length of earth pipe should \nbe used for earthing. This earth pipe is erected in 5 ft. depth'),
('pranjal', 114, 'ged for 45 cm x 45 cm size and 5 ft. depth. \n3. 3 Nos. of 40 mm dia and 2.9 mm thickness and 3 mts. (10 ft) length of earth pipe should \nbe used for earthing. This earth pipe is erected in 5 ft. depth earth pit and for the balance \nlength of earth pipe is driven by hammering into the ground. \n4. When a pipe is driven into the earth, the earth surrounding the pipe can be considered to \nbe  consisting  of  concentric  cylinders  of  earth  which  will  be  bigger  in  size  and  area,  as \nthey are away from the pipe. The current can travel into the earth with large area having \nlittle resistance. \n5. 3 m. length of electrode will have contact with the earth area of 3 m in radius. Hence to \nhave better effect 3 m pipe should be fixed at a distance of 6 m (i.e.) twice the distance \nof pipe length. \n6. For  better  earth  connection,  one  G  I  clamp  should  be  welded  to  the  earth  pipe  and  the \nother  clamp  bolted  with  2  nos.  11/2  x  ¬Ω  G  I  bolt  nuts  and  4  nos.  G.  I.'),
