('pranjal', 118, 'al Services Sub-Station             \nSeptember, 2011                   \n37 \n4.9 TESTING OF EARTHING SYSTEM \n \n4.9.1    Measurement of Earth Electrode Resistance \n \n‚Ä¢ Fall of potential method \n \nIn  this  method  two  auxiliary  earth  electrodes,  besides  the  test  electrode,  are \nplaced at suitable distances from the test electrode as shown in figure 4.4. A measured \ncurrent  is  passed  between  the  electrode  ‚ÄòA‚Äô  to  be  tested  and  an  auxiliary  current \nelectrode ‚ÄòC‚Äô  and the potential difference between the electrode ‚ÄòA‚Äô and the auxiliary \npotential  electrode  ‚ÄòB‚Äô  is  measured.  The  resistance  of  the  test  electrode  ‚ÄòA‚Äô  is  then \ngiven by: \nR =  V/I \nWhere,    R     =  Resistance of the test electrode in ohms, \n     V     =  Reading of the voltmeter in volts, \n     I      =  Reading of the ammeter in amperes \n \nIn most cases, there will be stray currents flowing in the soil and unless some \nsteps  are  taken  to  eliminate  their  effect,  they  may  produce  serio'),
('pranjal', 119, '    =  Reading of the ammeter in amperes \n \nIn most cases, there will be stray currents flowing in the soil and unless some \nsteps  are  taken  to  eliminate  their  effect,  they  may  produce  serious  errors  in  the \nmeasured  value.  If  the  testing  current  is  of  the  same  frequency  as  the  stray  current, \nthis elimination becomes very difficult. It is better to use an earth tester incorporating \na hand driven generator. These earth testers usually generate direct current, and have \nrotary  current  reverser  and  synchronous  rectifier  mounted  on  the  generator  shaft  so \nthat  alternating  current  is  applied  to  the  test  circuit  and  the  resulting  potentials  are \nrectified  for measurement by a direct reading moving coil ohm meter. The presence \nof stray currents in the soil is indicated by a wandering of the instrument pointer, but \nan increase or decrease of generator handle speed will cause this to disappear. \n \nAt the time of test, where possible, the t'),
('pranjal', 120, 'ts in the soil is indicated by a wandering of the instrument pointer, but \nan increase or decrease of generator handle speed will cause this to disappear. \n \nAt the time of test, where possible, the test electrode shall be separated from \nthe earthing system. The auxiliary electrode consists of 12.5 mm diameter mild steel \nrod driven up to one meter into the ground.  \n \n \n \n \n \n \n \n \n \n \n \n \n \n    \nAMMETER\nVOLTMETER\nA\nV\nCURRENT\nSOURCE\nA\nB\nC\nTEST \nELECTRODE\nPOTENTIAL \nELECTRODE\nCURRENT \nELECTRODE\nX = 1m\n \n \nFigure 4.4:  Fall of potential method \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n38\n4.9.2    Details of Earth Tester (Hand Driven) \n \nEarth  resistance  meter  are  employed  for  measurements  of  earth'),
('pranjal', 121, 'nce of Electrical General Services Sub-station           \n                   \n38\n4.9.2    Details of Earth Tester (Hand Driven) \n \nEarth  resistance  meter  are  employed  for  measurements  of  earth  resistance  in \nsubstation  and  other  electrical  installations.  An  Earth  resistance  meter  comprises  a  hand \ndriven magneto type D.C. Generator, a current reverser, rotary rectifier and ohm meter. \n \nThe  current  reverser  and  rotary  rectifier  are  driven  along  with  D.C.  Generator  by \ndriving  systems  which  incorporate  a  clutch  mechanism  for  unidirectional  rotation  and  a \ngovernor  for  speed  control.  The  function  of  current  reverser  is  to  change  the  direction  of \nflow of current in the soil and that of rotary rectifier is to maintain unidirectional current in \nthe potential coils of the ohm meter. \n \nThe ohm meter consists of a current coil and a potential coil mounted on a common \nspindle  and  placed  in  the  magnetic  field  of  a  permanent  '),
('pranjal', 122, 'rrent in \nthe potential coils of the ohm meter. \n \nThe ohm meter consists of a current coil and a potential coil mounted on a common \nspindle  and  placed  in  the  magnetic  field  of  a  permanent  magnet.  The  current  coil  is \nconnected  in  series  with  the  earth  electrodes  and  current  electrodes.  The  potential  coil  is \nconnected across the earth electrode and the potential electrode through the rotary rectifier. \nWhile  measuring  the  earth  resistance  the  terminals C1,  P1  are  connected  to  the  main  earth \nelectrode  P2  to  the  potential  electrode  and  C2  to  the  current  electrode.  The  potential  and \ncurrent electrodes are temporary  electrodes placed in the ground 50 to 75 feet apart and 50 \nto 75 feet & from the earth electrode as shown in below figure 4.5. \n \nWhen the megger is operated an ac current is produced in the coil. The voltage drop \nproduced in the earth electrode is applied across the potential coil. The current coil produces \na  torqu'),
('pranjal', 123, 'e 4.5. \n \nWhen the megger is operated an ac current is produced in the coil. The voltage drop \nproduced in the earth electrode is applied across the potential coil. The current coil produces \na  torque  in  the  clock  wise  direction,  and  the  potential  coil  produces  a  torque  in  anti-clock \nwise  direction.  The  current  applied  to  the  current coil  is  inversely  proportional  to  the  earth \nresistance  and  the  voltage  drop  applied  across  the potential  coil  is  directly  proportional  to \nthe  earth  resistance  the  torque  opposes  each  other and  brings  the  moving  system  to  rest \nwhen they are equal. The pointer indicates the earth resistance values on a calibrated scale.  \n \n \nPotential Terminal: P1 or P2 \nTest Earth \nElectrode \n \nPotential  \nElectrode \nCurrent  \nElectrode\n \nC1 \nP1 \nC2 \nP2 \n50 - 70 feet \n50 - 70 feet \nCurrent Terminal: or C2 \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                               '),
('pranjal', 124, 'rent  \nElectrode\n \nC1 \nP1 \nC2 \nP2 \n50 - 70 feet \n50 - 70 feet \nCurrent Terminal: or C2 \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n39 \n4.10    MAINTENANCE FREE EARTHING \n \nIn  conventional  earthing  system  GI  pipe  is  used  as earth  electrode.  It  is  provided \nwith charcoal and salt as conducting media, which provides a reasonable earth. Corrosion of \nmetallic parts is comparatively fast. It also requires maintenance by way of watering of earth \npits  and  chiseling  of  corrosion  prone  parts  and  replacement.  It  also  requires  monitoring \nwhich may not always be feasible in certain crowded and inaccessible areas.  \n \nWith technological developments in this field, modern maintenance free and durable \nearthing  system  employs  steel  conduc'),
('pranjal', 125, 'h may not always be feasible in certain crowded and inaccessible areas.  \n \nWith technological developments in this field, modern maintenance free and durable \nearthing  system  employs  steel  conductors  as  electrode  which  are  copper  claded  and  utilize \ngraphitic compounds and non corrosive salts as ‚Äú Ground Enhancing Material‚Äù which do not \nlead  to  corrosion.  Such  earth  pits  also  do  not  require  the  usual  watering  schedules  to \nmaintain the earth resistance within limits. Maintenance free earths are to be constructed as \nper RDSO‚Äôs specification no. RDSO/ PE/ SPEC/ 0109-2008 (REV‚Äò0‚Äô). \n \nWhere the earth pits are not easily accessible for schedule maintenance, maintenance \nfree earth pits shall be provided. In areas where clusters of earth pits are required to keep the \nearth resistance low, provision of maintenance free earth pits should be made during initial \ninstallation.  \n4.10.1  Earth Resistance  \nThe  earth  resistance  value  at  earth  bus  bar  should b'),
('pranjal', 126, 'e \nearth resistance low, provision of maintenance free earth pits should be made during initial \ninstallation.  \n4.10.1  Earth Resistance  \nThe  earth  resistance  value  at  earth  bus  bar  should be  less  than  0.5  ohms  for  major \nelectrical equipment & installation.  \n4.10.2  Applications \nThis earthing system may be used in following locations. \n Sub stations & switching stations \n Remote Terminal Units \n Transformer & Generator neutral earths \n Lightning arrester earths \n Equipment earths including panels  \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n40\n \nChapter 5 \n \nGENERAL \n \n \n5.1 ELECTRICAL ENERGY BASICS \n \nElectric current is divided into two types viz. Directional Current (DC) which is '),
('pranjal', 127, 'al Services Sub-station           \n                   \n40\n \nChapter 5 \n \nGENERAL \n \n \n5.1 ELECTRICAL ENERGY BASICS \n \nElectric current is divided into two types viz. Directional Current (DC) which is non-\nvarying   unidirectional   electric   current   (Example:   Current   produced   by   batteries)   and \nAlternating  Current  (AC),    which  reverses  in  regularly  recurring  of  time  and  which  has \nalternately  positive  and  negative  values  occurring a  specified  number  of  times  per  second. \nFor example: Household electricity produced by generators, Electricity supplied by utilities. \n \n‚Ä¢ Ampere (A) \n \nCurrent is the rate of flow of charge. The ampere is the basic unit of electric current.  \n \n‚Ä¢ Voltage (V) \n \nThe  volt  is  the  International  System  of  Unit  (SI)  measure  of  electric  potential \nor electromotive force. A potential of one volt appears across a resistance of one ohm \nwhen a current of one ampere flows through that resistance. \n‚Ä¢ Resistance \n \nResist'),
('pranjal', 128, 're  of  electric  potential \nor electromotive force. A potential of one volt appears across a resistance of one ohm \nwhen a current of one ampere flows through that resistance. \n‚Ä¢ Resistance \n \nResistance = Voltage/ Current \nThe unit of resistance is ohm (‚Ñ¶) \n‚Ä¢ Frequency \n \nThe  supply  frequency  tells  us  the  cycles  at  which  alternating  current  changes. \nThe unit of frequency is hertz (Hz: cycles per second). \n \n‚Ä¢ Kilovolt Ampere (kVA) \n \nIt is the product of kilovolts and amperes. This measures the electrical load on \na circuit or system. It is also called the apparent power. \n \nFor a single phase electrical circuit, Apparent power (kVA)     = Voltage x Amperes \n            1000 \n \nFor a three phase electrical circuit, Apparent power (kVA)     = ‚àö 3 x Voltage x Amperes \n                      1000 \n‚Ä¢ KVAr (Reactive Power) \n \nKVAr  is  the  reactive  power.  Reactive  power  is  the  portion  of  apparent  power \nthat  does  not  work.  This  type  of  power  must  be  supplied'),
('pranjal', 129, '             1000 \n‚Ä¢ KVAr (Reactive Power) \n \nKVAr  is  the  reactive  power.  Reactive  power  is  the  portion  of  apparent  power \nthat  does  not  work.  This  type  of  power  must  be  supplied  to  all  types  of  magnetic \nequipment,  such  as  motors,  transformers  etc.  larger  the  magnetizing  requirement, \nlarger the kVAr. \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n41 \n‚Ä¢ Kilowatt (kW) (Active Power) \n \nkW is the active power or the work-producing part of apparent power. \n \nFor single phase, Power (kW)  \n \n= Voltage x Ampere x Power factor \n                            1000 \n \nFor three phase, Power (kW)  \n \n= ‚àö 3 x Voltage x Amperes x Power factor \n  1000 \n‚Ä¢ Power Factor \n \nPower  Factor  (PF)  is  the  ratio  between  the  active  powe'),
('pranjal', 130, '\n                            1000 \n \nFor three phase, Power (kW)  \n \n= ‚àö 3 x Voltage x Amperes x Power factor \n  1000 \n‚Ä¢ Power Factor \n \nPower  Factor  (PF)  is  the  ratio  between  the  active  power  (kW)  and  apparent \npower (kVA). \n \nPower Factor (CosŒ¶ )    =     Active Power  (kW ) \nApparent Power (kVA) \n \n=           kW \n ‚àö(kW)\n2\n + (kVAr)\n2 \n \n=  1.0 (when kVAr = 0) \n \nWhen  current  lags  voltage  like  in  inductive  loads, it  is  called  lagging  power \nfactor  and  when  current  leads  voltage  like  in  capacitive  loads,  it  is  called  leading \npower factor. \n \nLower  the  power  factor;  electrical  network  is  loaded  with  more  current.  It \nwould be advisable to have highest power factor (close to 1) so that network carries \nonly active power which does real work. \n \n‚Ä¢ Kilowatt-hour (kWh) \n \nKilowatt-hour is the energy consumed by 1000 Watts load in one hour. If 1kW \n(1000  watts)  of  an  electrical  equipment  is  operated for  1  hour,  it  would  consume  1'),
('pranjal', 131, '\n \n‚Ä¢ Kilowatt-hour (kWh) \n \nKilowatt-hour is the energy consumed by 1000 Watts load in one hour. If 1kW \n(1000  watts)  of  an  electrical  equipment  is  operated for  1  hour,  it  would  consume  1 \nkWh of energy (1 unit of electricity). \n \n‚Ä¢ Electricity Tariff \n \nCalculation of electric bill for a H.T. consumer \n \nElectrical utility or power supplying companies charge industrial customers not \nonly based on the amount of energy used (kWh) but also on the peak demand (kVA) \nfor each month. \n \n‚Ä¢ Contract Demand \nContract  demand  is  the  amount  of  electric  power  that  a  customer  demands \nfrom utility in a specified interval. Unit used is kVA. It is the amount of electric power \nthat the consumer agreed upon with the utility. This would mean that utility has to plan \nfor the specified capacity. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011           '),
('pranjal', 132, 'ied capacity. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n42\n‚Ä¢ Maximum Demand \n \nMaximum  demand  is  the  highest  average  kVA  recorded during  any  one-\ndemand  interval  within  the  month.  The  demand  interval  is  normally  30  minutes,  but \nmay  vary  from  utility  to  utility  from  15  minutes  to 60  minutes.  The  demand  is \nmeasured using a tri-vector meter/ digital energy meter. \n‚Ä¢ PF Measurement \n \nA  power  analyzer  can  measure  PF  directly,  or  alternately  kWh,  kVAh  or \nkVArh readings are recorded from the billing meter installed at the incoming point of \nsupply. It would be advisable to have higher power factor (close to 1). An incentive is \ngiven  for  higher  power  factor  and'),
('pranjal', 133, ' are recorded from the billing meter installed at the incoming point of \nsupply. It would be advisable to have higher power factor (close to 1). An incentive is \ngiven  for  higher  power  factor  and  a  penalty  is  imposed  for  lower  power  factor  by \nutility in billing of user. \n5.2 POWER FACTOR \nThe  majority  of  ac  electrical  machines  and  equipment  draw  from  the  supply  an \napparent  power  (kVA)  which  exceeds  the  required  useful  power  (kW).  This  is  due  to  the \nreactive power (kVAR) necessary for alternating magnetic field. \nThe ratio of useful power (kW) to apparent power (kVA) is termed the power factor \nof the load. The reactive power is indispensable and constitutes an additional demand on the \nsystem.  \nThe power factor indicates the portion of the current in the system performing useful \nwork.  A  power  factor  of  unity  (100  percent)  denotes  100  percent  utilisation  of  the  total \ncurrent  for  useful  work  whereas  a  power  factor  of  0.'),
('pranjal', 134, 't in the system performing useful \nwork.  A  power  factor  of  unity  (100  percent)  denotes  100  percent  utilisation  of  the  total \ncurrent  for  useful  work  whereas  a  power  factor  of  0.70  shows  that  only  70  percent  of  the \ncurrent is performing useful work.  \n5.2.1    Principal Causes of Low Power Factor  \nThe following electrical equipment and apparatus have a lower factor: \na. Induction    motors    of    all \ntypes particularly when they \nare under loaded. \nb. Power     transformers     and \nvoltage regulators \nc. Arc welders \nd. Induction furnaces and \nheating coils.  \ne. Choke coils and magnetic systems. \nf. Fluorescent and discharge lamps, neon signs etc. \ng. The  principal  cause  of  a  low  power  factor  is  due  to the  reactive  power  flowing  in  the \ncircuit. The reactive power depends on the inductance and capacitance of the apparatus. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                '),
('pranjal', 135, 'rcuit. The reactive power depends on the inductance and capacitance of the apparatus. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n43 \n5.2.2    Effect of Power Factor to Consumer  \n \nThe disadvantages of low power factor are as follows:  \na) Overloading of cables and transformers \nb) Decreased line voltage at point of application. \nc) Inefficient operation of plant.  \n \nThe advantages of high power factor are as follows:  \na)  Reduction in the current.  \nb)  Reduction in power cost. \nc)  Reduced losses in the transformers and cables. \nd)  Lower loading of transformers, switchgears, cables, etc. \ne)  Increased capability of the power system  \nf)  Improvement in voltage in voltage conditions and apparatus performance, and \ng)  Reduction in voltage dips cau'),
('pranjal', 136, 'ansformers, switchgears, cables, etc. \ne)  Increased capability of the power system  \nf)  Improvement in voltage in voltage conditions and apparatus performance, and \ng)  Reduction in voltage dips caused by welding and similar equipment. \n \n5.2.3    Power Factor Calculation \n \n‚Ä¢ In initial condition \n‚Ä¢ kVAR1 =  kW x tan √∏1  \n‚Ä¢ In improved condition \n‚Ä¢ kVAR2 = kW x tan √∏2  \n‚Ä¢ Now,  \n  CkVAR = kVAR1- kVAR2 \n  \n    CkVAR= kW (tan √∏1- tan √∏2)\n \n \n5.3 ECONOMICS OF POWER FACTOR IMPROVEMENT  \n \nStatic capacitors, also called static condensers, when installed at or near the point of \nconsumption, provide necessary capacitive reactive power relieve distribution system before \nthe point of its installation from carrying the inductive reactive power to that extent. \n \nThe use of the static capacitors is an economical way of improving power factor on \naccount  of  their  comparatively  low  cost,  ease  of  installation.  less  maintenance,  low  losses \nand  the  advantage  of  extension  by  add'),
('pranjal', 137, ' is an economical way of improving power factor on \naccount  of  their  comparatively  low  cost,  ease  of  installation.  less  maintenance,  low  losses \nand  the  advantage  of  extension  by  addition  of  requisite  units  to  meet  the  load  growth. \nInstallation of capacitors also improves the voltage regulation and reduces amperes loading \nand energy losses in the supply apparatus and lines. \n \nThe  minimum  permissible  power  factor  prescribed  in the  conditions  of  supply  of \nElectricity  Boards  or  Licensees  and  the  reduction  in  charges  offered  in  supply  tariffs  for \nfurther improvement of power factor shall along with other considerations such as reduction \nof losses etc. determine the kVAR capacity of the capacitors to be installed. \n \n  \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                            '),
('pranjal', 138, '                                                                                                           CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n44\n5.4    USE OF CAPACITORS \n \nThe  successful  operation  of  power  factor  improvement  depends  very  largely  on  the \npositioning  of  the  capacitor  on  the  system.  Ideal  conditions  are  achieved  when  the  highest \npower factor is maintained under all load conditions. \n   \nIndividual  Compensation  -  Wherever  possible  the  capacitor  should  be  connected \ndirectly across the terminals of the low power factor appliance or equipment. \n \nGroup  Compensation  -  In  industries  where  a  large  number  of  small  motors  or  other \nappliances  and  machines  are  installed  and  whose  operation  is  periodical  it  is  economical  to \ndispense  with  individual  install'),
('pranjal', 139, 'es  where  a  large  number  of  small  motors  or  other \nappliances  and  machines  are  installed  and  whose  operation  is  periodical  it  is  economical  to \ndispense  with  individual  installation  of  capacitors.  A  bank  of  capacitors  may  be  installed  to \nconnect them to the distribution centre of main bus-bars of the group of machines. \n \nCentral  Compensation  -  Capacitors  may  also  be  installed  at  a  central  point  that  is  at \nthe  incoming  supply  or  service  position.  In  order  to  overcome  problems  of  drawing  leading \ncurrents  on  light  loads,  these  capacitors  may  be  operated  manually  or  automatically  as \nrequired. The automatic control is preferred as it eliminates human errors. \n \nOperation   may   be   arranged   by   means   of   AUTOMATIC   POWER   FACTOR \nCORRECTER and maintains the correct amount of kV AR in the circuit. \n \nThe method of connecting power factor capacitors to supply line and motors is given \nin figures. \n \n \nFigu'),
('pranjal', 140, 'ATIC   POWER   FACTOR \nCORRECTER and maintains the correct amount of kV AR in the circuit. \n \nThe method of connecting power factor capacitors to supply line and motors is given \nin figures. \n \n \nFigure   Methods of connecting capacitors for improvement of power factor to motors \n \n \n \n \nFigure Methods of connecting capacitors for improvement of power factor to supply line \nISOLATOR SWITCH 1TO \nBE OPENED AT NO LOAD \n(SUITABLE FOR GROUP \nOPERATION) \nCIRCUIT BREAKER \nCONTRACTOR OR FUSE \nSWITCH, AS \nRECOMMENDED (SUITABLE \nFOR BROUP OPERATION) \nTO STAR DELTA \nSTARTER \nTO STARTER \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n45 \n5.5 WHAT IS ENERGY CONSERVATION \nEnergy conservation means ‚ÄúReducing energy consumption by adopting energy \nconsuming efficient measu');
