('pranjal', 141, 'es Sub-Station             \nSeptember, 2011                   \n45 \n5.5 WHAT IS ENERGY CONSERVATION \nEnergy conservation means ‚ÄúReducing energy consumption by adopting energy \nconsuming efficient measures in various sectors‚Äù. It means \n \n‚Ä¢ Reducing energy consumption \n‚Ä¢ Avoiding wastage of energy. \n \n5.6 PERMIT TO WORK \n To   be   issued   by   an   authorized   person.(An   authorized   person   means   a   person \nauthorized under Rule-3 of Indian Electricity Rules,1956.) \n To be signed by  an authorized person \n The point at which it is safe to work. \n Time period. \n Step taken for safety like earthing etc. \n After completion of the work permit to work to be cancelled by those doing the work. \n \n5.7 COMMON SAFETY PRECAUTION  \n \nWhenever  in  a  substation,  any  maintenance  work  is  undertaken  following  safety \nprecautions should be observed. \n‚ñ† Access to live parts should be prevented by using enclosures. \n‚ñ† Verify that the equipment to be maintained is isolated from all s'),
('pranjal', 142, 'is  undertaken  following  safety \nprecautions should be observed. \n‚ñ† Access to live parts should be prevented by using enclosures. \n‚ñ† Verify that the equipment to be maintained is isolated from all sources. \n‚ñ† All auxiliary supplies should be isolated, springs of spring mechanism to be discharged \nand air of the pneumatic mechanism to be exhausted. \n‚ñ† Equipment,  which  is  isolated  from  supply  for  maintenance,  should  be  earthed  before \ntouching it.  \n‚ñ† Whenever safety interlocks are provided, steps should be taken to effectively use them. \nApart from precautions, factors like clarity of layout, accessibility of installation, live \nline  indicators  and  segregation  can  contribute  substantially  to  the  safety  during  operation \nand maintenance work.  \nThe  following  minimum  clearances  shall  be  maintained  for  bare  conductors  or  live \nparts  of  any  apparatus  in  outdoor  substations,  excluding  overhead  lines  of  HV/  EHV \ninstallations. \nVoltage Class \n(No'),
('pranjal', 143, '  clearances  shall  be  maintained  for  bare  conductors  or  live \nparts  of  any  apparatus  in  outdoor  substations,  excluding  overhead  lines  of  HV/  EHV \ninstallations. \nVoltage Class \n(Not  exceeding) \nGround clearance \n(Meters) \nSectional/safety/ \nworking clearances (Meters) \n11 KV 2.75 2.6 \n33 KV 3.7 2.8 \n66 KV 4.0 3.0 \n132 KV 4.6 3.5 \n220KV 5.5 4.3 \n400KV 8.0 6.5 \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n46\n5.8 ILLUMINATION SYSTEM IN SUB-STATION   \n \n5.8.1    Yard Illumination \n \nProper   illumination   is   required   for   operation   and   attending   fault   repair   in   a \nsubstation; in case of an outdoor substation yard should be uniformly illuminated. Required \nillumination  level'),
('pranjal', 144, 'mination   is   required   for   operation   and   attending   fault   repair   in   a \nsubstation; in case of an outdoor substation yard should be uniformly illuminated. Required \nillumination  level  of  yard  is  20  lux.  So  while  designing  a  sub-station  design  of  lighting \narrangement  must  be  kept  in  mind.  Height  of  luminaire  and  type  of  lamp  should  be \ncombined properly.  \n  \n5.8.2    Emergency Lighting system in sub-station \n \nEmergency  lighting  is  needed  in  case  of  failure  of AC  supply.  In  indoor  location \nsuch  as  switchgear  room  etc.  provision  of  suitable lamps  connected  to  solar  voltaic  cell \nsystem or battery should be made at suitable locations which are brought in service in case \nof AC supply failure. These are normally wired through automatic changeover contactors at \nthe DC distribution boards. \n \n5.9 FIRE FIGHTING ARRANGEMENT \nFor   safety   of   a   sub-station   and   human   being   fire   fighting   arrangements   are \nm'),
('pranjal', 145, 'gh automatic changeover contactors at \nthe DC distribution boards. \n \n5.9 FIRE FIGHTING ARRANGEMENT \nFor   safety   of   a   sub-station   and   human   being   fire   fighting   arrangements   are \nmaintained as per I.E. Rule 1956. A sub-station must have buckets filled with fine dry sand \nand ready for immediate use for extinguishing fires, in addition to fire extinguishers suitable \nfor  dealing  with  electric  fires,  shall  be  conspicuously  marked  and  kept  in  all  sub-stations. \nThe  fire  extinguishers  shall  be  tested  for  satisfactory  operation  at  least  once  a  year  and \nrecord of such tests shall be maintained.  \nSuitable  fire  extinguisher,  properly  maintained,  and  staff  trained  with  using  them; \nalso  precaution  should  be  made  regarding  oil  in  equipments  and  locations.  Training  record \nshall be maintained. \n\nFireman‚Äôs  axe  is  also  one  of  important \nequipment  to  be  kept  in  sub-station  required  for \ndisconnection  of  live  wire'),
('pranjal', 146, 'ipments  and  locations.  Training  record \nshall be maintained. \n\nFireman‚Äôs  axe  is  also  one  of  important \nequipment  to  be  kept  in  sub-station  required  for \ndisconnection  of  live  wire  or  line  in  case  of \nemergency.    Though  the  axes  are  to  be  tested  to \n20000 volts their use should be limited to 1000 to \n10000  volts  with  precautions.    The  fact  that  the \nhandle  is  covered  with  the  insulating  material \ndoes not guarantee the user safe working against electric shock. \n \nUses:- To cut live electric wires, after observing all cautions, to twist off padlocks, to \ncut through wooden obstruction in an emergency, to break glass window panes. \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n47 \n5.10    LIST OF SUPPORTING A'),
('pranjal', 147, '                                                  \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n47 \n5.10    LIST OF SUPPORTING AND OTHER AUXILIARY ITEMS AT SUB-STATION \n-  First Aid box-  The first aid box shall be provided at suitable location.  \n-  Safety belt \n-  Fire extinguishers \n- Fire buckets \n-  Hand gloves  \n-  Gum boots \n-  Stretcher \n-  Earth discharge rod \n-  Rain coat \n-  Torch \n-  Helmet \n-  Tool kit \n- Infrared thermal imaging camera \n \n-  Shock treatment chart  \n- Properly painted notice cum display boards, such as ‚ÄúMEN ON WORK‚Äù, ‚ÄúFUALTY \nLINE‚Äù etc.. \n \n5.11    INSTRUCTIONS FOR RESTORATION OF PERSON SUFFERING FROM \nELECTRIC SHOCK  \nUnder rule 44 (1) of the Indian Electricity rules, 1956, instructions for restoration of \npersons  suffering  from  electric  shock,  in  English  or  Hindi  and  the  local  language  shall    be \naffixed in a conspicuous place in  every sub- station for the  restoratio'),
('pranjal', 148, 'or restoration of \npersons  suffering  from  electric  shock,  in  English  or  Hindi  and  the  local  language  shall    be \naffixed in a conspicuous place in  every sub- station for the  restoration of  persons suffering \nfrom  electric  shock.  Every  employee  is  required  to make  himself  familiar  with  the \ninstructions so that they can follow rapidly. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n48\nANNEXURE - A \n \n \nTESTING OF TRANSFORMER OIL \n \nIn order to improve the performance and to prolong the life of the transformers, EHV grade \noil  is  used  as  per  the  requirement  laid  down  by  RDSO.  Application  and  interpretation  of  tests  on \ntransformer oil in service is given below.  \n  \nAppl'),
('pranjal', 149, 'e of the transformers, EHV grade \noil  is  used  as  per  the  requirement  laid  down  by  RDSO.  Application  and  interpretation  of  tests  on \ntransformer oil in service is given below.  \n  \nApplication and Interpretation of Tests on Transformer Oil in Service \n \nValue as per IS: 1866 \nSr. Tests \nPermissible \nlimits \nTo be re-\nconditioned \nTo be replaced \n1. \n \n \nElectric strength \n(Breakdown voltage) \nBelow72.5 kV \nMin. 30 kV Less than the \nvalue specified  \nIf   minimum   value   is \nnot attained after \nreconditioning. \n2. Specific resistance \n(Resistivity) \nOhm/cm at 27¬∞C \nAbove  \n10 x 10\n12 \n \nBetween  \n1 x 10\n12\n  to  \n10 x 10\n12\n \nBelow 1 x 10\n12\n \n3. \n \nWater content \nBelow 145 kV \nMax. 35 \nppm \nGreater  than  the \nvalue specified. \n- \n4. Dielectric dissipation \nfactor, Tan delta at 90¬∞C. \n0.01or less \n \nAbove  \n0.01 to 0.1 \nAbove 0.1 \n5. Neutralization Value mg \nKOH/g of oil. \n0.5 or Less \n \nAbove 0.5 Above 1.0 \n6. Interfacial  tension  N/m  at \n27¬∞C. \n0.02 or more \n \n0.01'),
('pranjal', 150, 'ta at 90¬∞C. \n0.01or less \n \nAbove  \n0.01 to 0.1 \nAbove 0.1 \n5. Neutralization Value mg \nKOH/g of oil. \n0.5 or Less \n \nAbove 0.5 Above 1.0 \n6. Interfacial  tension  N/m  at \n27¬∞C. \n0.02 or more \n \n0.015  and  above \nbut below 0.02 \nBelow 0.015 \n7. Flash point in ¬∞C 140 or more 125    and    above \nbut below 140 \nBelow 125 \n8. Sludge Non-detectable Sediment Perceptible sludge \n \nImportant Characteristics of New Oil when Tested at the Manufacturer‚Äôs Works (Ref: IS 335) \n \nS.\nNo \nCharacteristics \nTest Method \n(Ref. to IS: or \nAppendix) \nRequirements \n1. Appearance A representative \nsample in 100 mm \nthick layer \nThe oil is clear and transparent free \nfrom suspended matter or \nsediments. \n2. Electric strength \n(break down voltage) \na. New unfiltered oil. \nb. After filtration. \nIS: 6792-1972 a.  Min. 30 kV (rms) \nb. If the above value is not attained, \nthe oil shall be filtered, 60 \nkV(rms), RDSO\'s requirement. \n3. Resistivity at \na.     90¬∞C \nb.     27¬∞C \nIS: 6103-1971 Min. 35 x 10\n12\n Ohm-'),
('pranjal', 151, ' Min. 30 kV (rms) \nb. If the above value is not attained, \nthe oil shall be filtered, 60 \nkV(rms), RDSO\'s requirement. \n3. Resistivity at \na.     90¬∞C \nb.     27¬∞C \nIS: 6103-1971 Min. 35 x 10\n12\n Ohm-cm \n1500 x 10\n12\n Ohm-cm \n4. Dielectric  dissipation  factor \n(tan delta) at 90¬∞C \nIS: 6262-1971 Max. 0.002 \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n49 \n \nS.\nNo \nCharacteristics \nTest Method \n(Ref. to IS: or \nAppendix) \nRequirements \n5. Water content Appendix  E  of  IS: \n335-1983 \nMax. 50 ppm \n6. Interfacial tension at 27¬∞C IS: 6104-1971 Min. 0.04 N/m \n7. Flash point IS : 1448 Min. 140¬∞C \n8. Dissolved gas content  4 ‚Äì 8% \n9. Neutralization value \na.    Total acidity \nb.    Inorganic \nacidity/alkalinity \n \nIS: 1448 \n- do - \na. Max. 0.03 mg KOH/g \nb. Nil '),
('pranjal', 152, 'lash point IS : 1448 Min. 140¬∞C \n8. Dissolved gas content  4 ‚Äì 8% \n9. Neutralization value \na.    Total acidity \nb.    Inorganic \nacidity/alkalinity \n \nIS: 1448 \n- do - \na. Max. 0.03 mg KOH/g \nb. Nil \n \nPurification of Transformer Oil \n \nThe  object  of  oil  purification  is  to  remove  all  contaminants  such  as  water,  carbon  deposits,  dirt, \nsludge, dissolved moisture and  gases. The most important quality to be preserved is the di-electric \nstrength, which is affected by presence of moisture. \n \nThe  insulating  material  used  in  the  winding  are  hygroscopic  in  nature  and  therefore  moisture  is \nabsorbed through defective breathers, gasket and addition of untreated make up oil. It is essential to \nremove these impurities in purifying the oil when the di-electric strength goes below the permissible \nlimits. \n \nFor  purifying  the  transformer  oil,  machine  conforming  to  RDSO\'s  specification  no.ETI/PSI/103 \nmay be used. \n \nOil Sampling \n \nGeneral precautions \n  \n'),
('pranjal', 153, ' goes below the permissible \nlimits. \n \nFor  purifying  the  transformer  oil,  machine  conforming  to  RDSO\'s  specification  no.ETI/PSI/103 \nmay be used. \n \nOil Sampling \n \nGeneral precautions \n  \ni. Use always clean, dry and amber glass bottles as per IS: 6855-1973 \nii. Take oil sample preferably in dry weather and avoid any external contamination. \niii. Oil sample shall be at least as warm as the ambient air. \n \nSampling procedure \ni. First drain at least one liter oil to eliminate any contaminations which is accumulated in   \n the drain cock. \nii. Rinse the bottles with the oil being sampled. \niii. After taking the sample, ensure that the cock is correctly closed. \niv. Check that the label marking are correct and complete. \nv. Store samples in a dark place. \nvi. Ensure that the sampling is done by an experienced person. \nvii. Ensure that each of sampling bottle is filled up to 95 to 98 percent of its capacity. \n\n                                                                    '),
('pranjal', 154, 'ing is done by an experienced person. \nvii. Ensure that each of sampling bottle is filled up to 95 to 98 percent of its capacity. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n50\nANNEXURE -B \n \nCONDITION MONITORING OF TRANSFORMER BY DISSOLVED \nGAS ANALYSIS \n \n INTRODUCTION \n \nIn  order  to  detect  incipient  faults  in  the  transformer  and  to  arrest  deterioration/ \ndamage  to  the  transformer  insulation,  gases  dissolved  in  the  transformer  oil  are  detected, \nanalysed and preventive measures adopted. \nGas  Chromatography  method  is  used  for  detection  of the  dissolved  gases  and \nidentification of incipient faults. The most significant  gases  generated by  decomposition of \noil  and  deter'),
('pranjal', 155, ' \nGas  Chromatography  method  is  used  for  detection  of the  dissolved  gases  and \nidentification of incipient faults. The most significant  gases  generated by  decomposition of \noil  and  deterioration  of  paper  insulation  on  the  conductor  are  hydrogen,  methane,  ethane, \nethylene  and  acetylene.  The  quantities  of  these  gases  dissolved  in  transformer  oil  vary \ndepending upon the type and severity of the fault conditions. \n \n SENSITIVITY LIMITS \n \nGas  Chromatography  apparatus  should  be  able  to  detect  the  following  minimum \nconcentration of dissolved gases: \n \nHydrogen : 5 ppm \nHydrocarbon   : 1 ppm \nCarbon oxides : 25 ppm \n \n ESTABLISHMENT OF REFERENCE VALUES/ BENCH MARKS \n \nTo  establish  a  reference  value/  bench  mark,  gas  as generated  from  initial sample  of \noil from each healthy transformer should be collected. Results of the analysis are taken as a \nreference  value/  benchmark.  Results  of  later  periodic  analysis  are  compared  wi'),
('pranjal', 156, 'tial sample  of \noil from each healthy transformer should be collected. Results of the analysis are taken as a \nreference  value/  benchmark.  Results  of  later  periodic  analysis  are  compared  with  the \nbenchmark for each transformer. \n \n ESTABLISHMENT OF NORMS \nThe contents of various  dissolved gases in the transformer oil vary with  design and \noperating  conditions.  It  is  desirable  that  the  values  of  concentration  of  gases  of  healthy \ntransformers of different age groups are to be gathered by the Railways concerned to evolve \nsuitable  norms.  However,  as  a  starting  point,  the  permissible  concentrations  of  dissolved \ngases in the oil of a healthy transformer are given below as guidelines: \n \n \nGas Less than 4 years \nin service (ppm) \n4-10 years in \nservice (ppm) \nMore than 10 years in \nservice (ppm) \nHydrogen (H\n2\n) 100/150 200/300 200/300 \nMethane (CH\n4\n) 50/70 100/150 200/300 \nAcetylene (C\n2\n H\n2\n) 20/30 30/50 100/150 \nEthylene (C\n2\n H\n4\n) 100/150 150/'),
('pranjal', 157, 'ppm) \nMore than 10 years in \nservice (ppm) \nHydrogen (H\n2\n) 100/150 200/300 200/300 \nMethane (CH\n4\n) 50/70 100/150 200/300 \nAcetylene (C\n2\n H\n2\n) 20/30 30/50 100/150 \nEthylene (C\n2\n H\n4\n) 100/150 150/200 200/400 \nEthane (C\n2\n H\n6\n) 30/50 100/150 800/1000 \nCarbon dioxide (CO\n2\n) 3000/3500 4000/5000 9000/12000 \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n51 \n DIAGNOSIS OF FAULT \n \nBasic  Diagnosis  of  DGA  is  based  upon  the  quantities  of  gases  generated.  Types  of \ngases  in  excess  of  norms  produced  by  oil  decomposition/  cellulosic  material  depend  upon \nthe hot spot temperature produced by faults. \n \nCharacteristics of gases associated with various faults are as under: \n \nMethane (CH\n4\n) Low temperature hot spot \nEthane (C\n2\n H\n6\n) H'),
('pranjal', 158, 'l  depend  upon \nthe hot spot temperature produced by faults. \n \nCharacteristics of gases associated with various faults are as under: \n \nMethane (CH\n4\n) Low temperature hot spot \nEthane (C\n2\n H\n6\n) High temperature hot spot \nEthylene (C\n2\n H\n4\n) Strong over heating \nAcetylene (C\n2\n H\n2\n) Arcing \nHydrogen (H\n2\n) Partial discharge \nCarbon dioxide (CO\n2\n) \nCarbon monoxide (CO) \nThermal decomposition of paper insulation \n \n WORD OF CAUTION \n \nTo  start  with  the  diagnosis,  it  is  necessary  to  be satisfied  that  measured  gas \nconcentrations  are  significant  and  high  enough  to  warrant  diagnosis,  because  some  amount \nof gases will always be there due to normal operating conditions without any fault but it can \nbe sufficient to be misleading. The reasons for the situation are: \n Gases  formed  during  the  refining  processes  and  not completely  removed  by  oil \ndegassing. \n Gases formed during drying and impregnating the transformer in sheds/ workshops. \n Gases forme'),
('pranjal', 159, '\n Gases  formed  during  the  refining  processes  and  not completely  removed  by  oil \ndegassing. \n Gases formed during drying and impregnating the transformer in sheds/ workshops. \n Gases formed in the event of previous faults and not completely removed from the oil \nimpregnated insulation before being refilled with degassed oil. \n Gases formed during repairs by brazing, welding, etc. \n \n \n PROCEDURE FOR FAULT DIAGNOSIS \n Obtain the results of concentration of various gases in terms of microlitre (ppm). \n Compare the concentrations with sensitivity limits. These should be at least ten times \nsensitivity. \n If it exceeds sensitivity limits, compare with benchmarks. \n If  it  exceeds  benchmarks,  compare  concentrations  with  norms  depending  upon  age \nand design of transformer. \n If  one  or  more  gases  are  above  norms,  compare  with the  last  sample  results;  if \nincrease is sufficient, obtain a check sample. \n If the check sample confirms the results, calcula'),
('pranjal', 160, 'mer. \n If  one  or  more  gases  are  above  norms,  compare  with the  last  sample  results;  if \nincrease is sufficient, obtain a check sample. \n If the check sample confirms the results, calculate the rate of increase of gas.  If rate \nof  increase  is  more  than  10%  per  month,  it  is  considered  rapid  and  warrants \nimmediate further investigations including lifting of core and internal inspection. \n If  the  gas  production  rate  is  medium,  i.e.,  less  than  10%  per  month,  sampling \nfrequency to be increased from quarterly to monthly. \n Take a planned shut down for further investigation. \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n52\nANNEXURE‚Äì C \n \nINFRARED THERMAL IMAGING CAMERA \n \n'),
('pranjal', 161, '                                                 Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n52\nANNEXURE‚Äì C \n \nINFRARED THERMAL IMAGING CAMERA \n \nCHECKING OF ELECTRICAL LOOSE CONNECTIONS AND HIDDEN FAULTS \n   \nFailure   of   electrical   &   mechanical \ndevices  is  because  of  component  failure  or \nelectrical  loose  connections.  Failure  such  as \noverhead  line  problem,  problem  in  electric \nconnections,  overheating,  hidden  faults  and \ninsulation   defect   etc   results   in   thermal \nheating. Infrared thermal imaging camera can \ndetect    electrical    hot    spots    on    faulty \nequipment and hidden faults, when \nconducting    routine    survey    of    electrical \nsystem.   \n \nFor detailed technical specifications please refer RDSO specification No.TI/ SPC/ OHE/ \nTIPS/ 1030 (6/ 2005) Rev. 1 \n \nAdvantages \n1. It helps to find out electrical hot spots and faulty equipments in incipient conditions. \n2. It is an ide'),
('pranjal', 162, 'lease refer RDSO specification No.TI/ SPC/ OHE/ \nTIPS/ 1030 (6/ 2005) Rev. 1 \n \nAdvantages \n1. It helps to find out electrical hot spots and faulty equipments in incipient conditions. \n2. It is an ideal means for professionals looking for safety and reliability when conducting \nroutine surveys of electrical systems, switchgear and electrical components. \n3. It is a light weight, comfortable and sensitive test instrument with touch screen, text features.  \n       \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n53 \n \nREFERENCES \n \n \n \n1. IS:  10028  (Pt.III)  -  1981,  reaffirmed  1993  &  1998  ‚ÄìCode  of  Practice  for  Selection, \nInstallation and Maintenance of Transformers (Part‚Äì III Maintenance). \n2. '),
('pranjal', 163, ' \n53 \n \nREFERENCES \n \n \n \n1. IS:  10028  (Pt.III)  -  1981,  reaffirmed  1993  &  1998  ‚ÄìCode  of  Practice  for  Selection, \nInstallation and Maintenance of Transformers (Part‚Äì III Maintenance). \n2. IS: 3043-1987 reaffirmed 1996 ‚ÄìCode of Practice for Earthing. \n3. Design Manual for General Power Supply Installations Volume 3, issued by Railway Board, \nNew Delhi. \n4. Manual of AC traction - Maintenance and operation    - Volume II (part I) 1994.  \n5. Field study conducted at various Railway installations. \n6. Field study conducted at M.P State Electricity Sub-stations. \n7. Presentations given by various participants during seminar held at CAMTECH on 22. 07.11. \n8. The book of Electrical Power Supply published by IRIEEN, Nasik Road ‚Äì May, 2010. \n9. The  book  on  Electrical  Sub-Station  and  Earthing  prepared  by  Er.  B.  Jeyaraman,  Chief \nEngineer, Chennai. \n10. Maintenance  instructions  for  distribution  transformer  of  M/s  Tesla  Transformer  Ltd., \nBhopal. \n11. Earthing  pro'),
('pranjal', 164, 'd  Earthing  prepared  by  Er.  B.  Jeyaraman,  Chief \nEngineer, Chennai. \n10. Maintenance  instructions  for  distribution  transformer  of  M/s  Tesla  Transformer  Ltd., \nBhopal. \n11. Earthing  protection  in  electrical  installations  September,  2008  by  Institution  of  Engineers \n(India), Hyderabad. \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n54\n \n \n \n   To   upgrade   maintenance   technologies   and \nmethodologies  and  achieve  improvement  in \nproductivity,   performance   of   all   Railway \nassets  and  manpower  which  inter-alia  would \ncover  reliability,  availability,  utilisation  and \nefficiency. \n \n    If you have any suggestions and any specific Comments \n    please write to us. \n \n   '),
('pranjal', 165, ' and  manpower  which  inter-alia  would \ncover  reliability,  availability,  utilisation  and \nefficiency. \n \n    If you have any suggestions and any specific Comments \n    please write to us. \n \n    Contact person    : Director (Elect.) \n \n    Postal Address    : Indian railways \nCentre for Advanced  \nMaintenance technology, \nMaharajpur, Gwalior. \nPin code ‚Äì 474 005 \n \nPhone     : 0751 ‚Äì 2470740 \n0751 ‚Äì 2470803 \n \nE-mail    : direlcamtech@gmail.com \n \nFax   : 0751 - 2470841 \nOUR OBJECTIVE \n \n ');
