('pranjal', 2, '	\n\Z\Z\n\Z\n\r\Z\n\n\r\n\n\n\n\Z	\n\Z\n \n\n	\n\n\n\n!\"\n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n3 \n FOREWORD \n \n \n \nUninterrupted electric power supply is essential for platforms, station building, service \nbuilding  and  staff  quarters.  The  maintenance  practices  followed,  play  a  vital  role  in  ensuring \nreliable power supply.  \n  \nAt present different Zonal Railways are having different maintenance practices of the \nelectrical  general  service  sub-station.  Need  has  been  felt  for  a  hand  book  on  maintenance \naspects  of  Electri'),
('pranjal', 3, 'different Zonal Railways are having different maintenance practices of the \nelectrical  general  service  sub-station.  Need  has  been  felt  for  a  hand  book  on  maintenance \naspects  of  Electrical  General  Services  Sub-station. CAMTECH  has  made  an  effort  in  this \ndirection   by   suggesting   maintenance   schedules   for   various   sub-station   equipment   and \nmaintenance  tips  to  improve  reliability.  It  also  contains  information  on  failures,  their  trouble \nshooting and an approach to investigation. \n \nI hope this hand book will be useful to maintenance personnel and will assist them in \nkeeping the sub-stations in excellent working condition with high reliability. \n \n \n \n CAMTECH, Gwalior               S. C. Singhal \n Date: 21.09.2011                Executive Director \n \n \n \n \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011     '),
('pranjal', 4, ' Director \n \n \n \n \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n4\n \nPREFACE \n   \n \n \nThe  proper  upkeep  and  maintenance  of  sub-station  & its  equipment  are  necessary  to \nensure  reliability  and  availability  of  electrical  power  supply  to  the  users.  A  well  planned \nmaintenance  schedule  of  each  &  every  equipment  will  ensure  trouble  free  service  and \nreduction in interruptions / failures.  \n \nThis  handbook  on  maintenance  of  Electrical  General Services  Sub-Station  has  been \nprepared  by  CAMTECH  with  the  objective  to  disseminate  knowledge  among  the  working \npersonnel and making aware of maintenance techniques to be adopted in field.  \n \nThis   handbook   includes '),
('pranjal', 5, 'epared  by  CAMTECH  with  the  objective  to  disseminate  knowledge  among  the  working \npersonnel and making aware of maintenance techniques to be adopted in field.  \n \nThis   handbook   includes   brief   description   of   various   sub-station   equipment,   their \nmaintenance   schedules,   maintenance   tips   to   improve reliability,   causes   and   remedial \nmeasures of failure along with an approach to failure investigation. \n    \nIt is clarified that this handbook does not supersede any existing provisions laid down by \nRDSO or Railway Board/Zonal Railways. This hand book is for guidance only and it is not a \nstatutory document.   \n \nI  am  sincerely  thankful  to  EEM  Directorate  of  RDSO/  Lucknow  and  also  all  field \npersonnel specially SC Division who helped us in preparing this handbook. \n \nTechnological up-gradation & learning is a continuous process. Please feel free to write \nto us for any addition/modification in this handbook.  \n \n \n \nCAMTECH, Gwalior     '),
