('pranjal', 11, '   32 \n4.7.2   Lightning Arrestors         32 \n4.7.3   Circuit Breakers        33 \n4.7.4   Transformers         33 \n4.7.5   Current Transformers and Potential Transformers   34 \n4.7.6   Other Equipments          34 \n4.7.7   Fences         34 \n4.7.8   Ground Wire          34 \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n7 \nChapter     Description                             Page No. \n \n4.7.9   Cables and Supports       35 \n4.7.10   Panels and Cubicles       35 \n4.8 DISTRIBUTION TRANSFORMER STRUCTURE EATHING     35 \n4.9 TESTING OF EARTHING SYSTEM      37 \n4.9.1   Measurement of Earth Electrode Resistance        37 \n4.9.2   Details of Earth Tester (Hand Driven)     38 \n4.10    MAINTENANCE FREE EARTHING      39 \n4.10.1 Earth Resistance            39 \n4.10.2 A'),
('pranjal', 12, '   Measurement of Earth Electrode Resistance        37 \n4.9.2   Details of Earth Tester (Hand Driven)     38 \n4.10    MAINTENANCE FREE EARTHING      39 \n4.10.1 Earth Resistance            39 \n4.10.2 Applications          39 \n \n5 GENERAL              40 \n5.1 ELECTRICAL ENERGY BASICS        40 \n5.2 POWER FACTOR           42 \n5.2.1   Principal Causes of Low Power Factor        42 \n5.2.2   Effect of Power Factor to Consumer      43 \n5.2.3   Power Factor Calculation         43 \n5.3 ECONOMICS OF POWER FACTOR IMPROVEMENT    43 \n5.4 USE OF CAPACITORS        44 \n5.5 WHAT IS ENERGY CONSERVATION         45 \n5.6 PERMIT TO WORK         45 \n5.7 COMMON SAFETY PRECAUTION       45 \n5.8 ILLUMINATION SYSTEM IN SUB-STATION         46   \n5.8.1   Yard Illumination        46 \n5.8.2   Emergency Lighting system in sub-station    46 \n5.9 FIRE FIGHTING ARRANGEMENT      46 \n5.10   LIST OF SUPPORTING AND OTHER AUXILIARY ITEMS AT  \nSUB-STATION         47 \n5.11    INSTRUCTIONS FOR RESTORATION OF PERSON  \nSUFFERING F'),
('pranjal', 13, ' sub-station    46 \n5.9 FIRE FIGHTING ARRANGEMENT      46 \n5.10   LIST OF SUPPORTING AND OTHER AUXILIARY ITEMS AT  \nSUB-STATION         47 \n5.11    INSTRUCTIONS FOR RESTORATION OF PERSON  \nSUFFERING FROM ELECTRIC SHOCK      47 \n \nANNEXURE ‚Äì A \nTESTING OF TRANSFORMER OIL       48 \nANNEXURE ‚Äì B   \nCONDITION MONITORING OF TRANSFORMER BY    \nDISSOLVED GAS ANALYSIS        50 \nANNEXURE ‚Äì C \nINFRARED THERMAL IMAGING CAMERA     52 \n  \nREFERENCE          53 \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n8\nISSUE OF CORRECTION SLIPS \n \nThe correction slips to be issued in future for this handbook will be numbered as follows : \n \n CAMTECH/E/11-12/Sub-Station/C.S. # XX date--------- \n  \n Where  ‚ÄúXX‚Äù  is  the  serial  number '),
('pranjal', 14, ' SLIPS \n \nThe correction slips to be issued in future for this handbook will be numbered as follows : \n \n CAMTECH/E/11-12/Sub-Station/C.S. # XX date--------- \n  \n Where  ‚ÄúXX‚Äù  is  the  serial  number  of  the  concerned  correction  slip  (starting  from  01 \nonwards). \n \nCORRECTION SLIPS ISSUED \n \nSr. No.  Date of issue Page no. and Item no. \nmodified \nRemarks \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n1 \n \nChapter 1 \n \nINTRODUCTION \n \n \n \n Electrical  General  Services  Sub-station  is  a  distribution  sub-station  from  which  electric \nsupply  is  distributed  to  the  different  users.  In  a substation  there  are  numbers  of  incoming  and \noutgoing  circuit'),
('pranjal', 15, '  Sub-station  is  a  distribution  sub-station  from  which  electric \nsupply  is  distributed  to  the  different  users.  In  a substation  there  are  numbers  of  incoming  and \noutgoing  circuits  each  having  its  isolator,  circuit  breaker,  transformers  etc.  connected  to  bus-bar \nsystem.  These  equipment  are  mostly  static  type.  Safety  and  protection  of  equipment  as  well  as \nworking  personnel  is  also  a  considerable  factor.  Lightening  arresters,  earthing  of  equipment  and \nfencing is done for this  purpose. Maintenance of a sub-station is essential to ensure un-interrupted \nelectric  supply  to  the  using  points  which  involves vigilance,  care  and  well-defined  scheme  of \nprocedures.  Such  scheme  indicates  the  authority  and  responsibility  of  persons  at  various  levels.  It \nconsists of many of periodic schedule maintenance, regular inspections, testing and rectification of \ndefects. \n \n   \nSINGLE LINE DIAGRAM OF 33 OR 11 kV/440 V SU'),
('pranjal', 16, 'of  persons  at  various  levels.  It \nconsists of many of periodic schedule maintenance, regular inspections, testing and rectification of \ndefects. \n \n   \nSINGLE LINE DIAGRAM OF 33 OR 11 kV/440 V SUBSTATION \n \n \n   \n \n                                                           \n  \n                                                                         \n \n \n      \n  \n                                                                                  \n \n \n \n                                                                         \n                                                              \n \n                                                     \n                                                                     \n                                              \n                                                 \n                                   \n                                                          \n \n \n                                \nFigure 1.1 Single Line Diagram of 33/11 kV/440 V'),
('pranjal', 17, '                   \n                                   \n                                                          \n \n \n                                \nFigure 1.1 Single Line Diagram of 33/11 kV/440 V Sub-station \n \n33 or 11 kV supply from Electricity Board \n \nIsolator \nLightening arrester  \nIsolator \n33 or 11kV/415V \nTransformer\n \nCB \nLT Bus Coupler \nCircuit Breaker (CB) \nIsolator \n33 or 11kV/415V Transformer \nCircuit Breaker (CB) \nLT feeders to different Load \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n2\n \nUpkeepment of records of each inspection is essential. If any replacement is carried \nout or adjustment of certain setting is done then these must be entered in a logbook. A rigid \nsystem  of  maintenance'),
('pranjal', 18, 'epment of records of each inspection is essential. If any replacement is carried \nout or adjustment of certain setting is done then these must be entered in a logbook. A rigid \nsystem  of  maintenance  of  each  equipment  will  ensures  long  life,  trouble  free  service  and \nreduction  in  unnecessary  interruptions.  All  work  on major  electrical  installations  must  be \ncarried out under permit to work system. \n \nThe  ‚Äúpermit  to  work‚Äù  is  to  be  issued  through  permit  card  only  by  an  authorized \nperson. As the name suggests it authorizes the maintenance supervisor and his team to carry \nout work. Furthermore, this card will indicate unambiguously the points at which it is safe to \nwork,  the  time  interval  when  it  is  to  be  done,  steps  to  be  taken  to  ensure  safety  such  as \nearthing, display of danger notices etc. at the nearest live point. It should have the signature \nof  the  authorized  person.  After  the  work  is  completed  the  permit  card  sh'),
('pranjal', 19, 'safety  such  as \nearthing, display of danger notices etc. at the nearest live point. It should have the signature \nof  the  authorized  person.  After  the  work  is  completed  the  permit  card  should  be  cancelled \nand it should be taken back. Danger notices should be put up or removed by the responsible \nsupervisor who will take the charge of keys equipment, rooms, etc. \n \n1.1 EQUIPMENT IN DISTRIBUTION SUB-STATION \n \nThe following equipment are installed in Electrical General Services Sub-station: \n1. Distribution Transformer \n2. Circuit breaker \n3. Lightning Arrester \n4. Air Break (AB) switches/ Isolator \n5. Insulator \n6. Bus-bar  \n7. Capacitor Bank \n8. Earthing  \n9. Fencing  \n10. Distribution panel board \n \n1.1.1    Distribution Transformer \n \nThe  distribution  transformer  is  a  main  and  largest equipment  of  Electrical  General \nService  Sub-station.  It  is  basically  a  static  electrical  device  which  steps  down  the  primary \nvoltage of 33kV or 11 kV to secondar'),
('pranjal', 20, '  main  and  largest equipment  of  Electrical  General \nService  Sub-station.  It  is  basically  a  static  electrical  device  which  steps  down  the  primary \nvoltage of 33kV or 11 kV to secondary distribution voltage of 415-440 volts between phases \nand  215  volts  between  phase  and  neutral  through  delta-star  windings  by  electromagnetic \ninduction without change in frequency.  \n  \nTransformer consists of the following parts and components. \n \n‚Ä¢ Primary winding   Secondary winding \n‚Ä¢ Transformer tank   Conservator  \n‚Ä¢ Cooling tubes     Breather \n‚Ä¢ Buchholz Relay    Explosion vent \n‚Ä¢ Tap changer       Oil inlet valve \n‚Ä¢ Oil outlet valve   Oil level indicator \n‚Ä¢ L.T. terminals    H.T. terminals \n‚Ä¢ Temperature gauge \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011'),
('pranjal', 21, '                                                                                                      \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n3 \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n   \n \n Working of Important Components \n \n‚Ä¢ Conservator ‚Äì Equipped with transformer of rating 500 kVA & above \n \nIt  is  a  drum  containing  transformer  oil  and  mounted  at  the  top  of  the \ntransformer  and  connected  to  the  main  tank  by  a  pipe.  As  the  volume  of  oil  of \ntransformer   tank   expands   and   contracts \naccording  to  heat  produced,  this  expansion \nand contraction of oil causes the level of the \noil in conservator to rise and fall. The aim of \nconservator is to \n- maintain the oil level in tank \n- provide space for the expanded oil. \n‚Ä¢ Breather \n \nIt is attached to conservator tank and \ncontains silica gel, which prevents the moist \nair   from   entering   into   the   tank   duri'),
('pranjal', 22, 'el in tank \n- provide space for the expanded oil. \n‚Ä¢ Breather \n \nIt is attached to conservator tank and \ncontains silica gel, which prevents the moist \nair   from   entering   into   the   tank   during \ncontraction  of  oil.  When  oil  is  hot  there  is \nexpansion   and   gas   passes   to   atmosphere \nthrough  it.  When  oil  is  cooled,  it  contracts \nand    the    air    enters    in    it.    It    prevents \ntransformer oil from moisture \ncontamination. \nFigure 1.2      3 Phase, 500 kVA, 11/0.433 kV Natural Air Oil Cooled Distribution Transformer \n \nEXPLOSION VALVE \n \nDIAPHRAGM \n \nOIL LEVEL INDICATOR \n \nHT TERMINAL \n \n  TEMPERATURE GAUGE \n \nTAP CHANGER  \nMANUALLY  \nOPERATED \n \n \n \n \n \nCOOLING TUBES \n \n \nTANK \n \nWHEEL  \n \n \nOIL OUTLET DRAIN COCK \nBUCHHOLZ \nRELAY \n \n \nOIL INLET  \nVALVE \n \n \n \nBREATHER \n \n \n \n \n \n \n            OIL \n \n \n \n \n             EARTH \n               CONSERVATOR \n \n\n                                                                                           '),
('pranjal', 23, 'LVE \n \n \n \nBREATHER \n \n \n \n \n \n \n            OIL \n \n \n \n \n             EARTH \n               CONSERVATOR \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n4\n‚Ä¢ Buchholz Relay \n \nIt   is   protective   relay   of   transformer. \nThis  device  signals  the  fault  as  soon  as  it \noccurs  and  cuts  the  transformer  out  of  the \ncircuit   immediately.   This   is   gas   operated \nprotective  relay.  It  is  installed  in  between  the \npipe  connecting  the  tank  and  the  conservator. \nThis relay works on the formation of excessive \noil  vapors  or  gas  inside  the  transformer  tank \ndue  to  internal  fault  of  transformer.  It  consists \nof  two  operating  floats  A  and  B.  These  are \noperated by two '),
('pranjal', 24, 'ation of excessive \noil  vapors  or  gas  inside  the  transformer  tank \ndue  to  internal  fault  of  transformer.  It  consists \nof  two  operating  floats  A  and  B.  These  are \noperated by two mercury switches separately provided for each float. The float A is \nfor bell alarm and float B is for operating the tripping circuit. \n \n \n \n \n \n \n \n \n \n \n \n \n \n \nWhenever there is a minor fault or low level of oil, the bell alarm operated by \nfloat ‚ÄòA‚Äô and whenever there is severe fault in the transformer, float ‚ÄòB‚Äô operated due \nto excessive gases. It trips the circuit breaker and transformer is put out of circuit. \n \n‚Ä¢ Explosion Vent \n \nA   major   fault   inside   the   transformer \ncauses instantaneous vaporization of oil, leading \nto  extremely  rapid  buildup  of  gaseous  pressure. \nIf  this  pressure  is  not  released  with  in  few \nmilliseconds,  the  transformer  tank  can  rupture, \nspilling  oil  over  a  wide  area.  An  explosion  vent \nprovides    instantaneous    releas'),
('pranjal', 25, 'f  this  pressure  is  not  released  with  in  few \nmilliseconds,  the  transformer  tank  can  rupture, \nspilling  oil  over  a  wide  area.  An  explosion  vent \nprovides    instantaneous    releasing    of    such \ndangerous pressure and protects the transformer. \n \n‚Ä¢ Oil level Indicator \n \nIt  indicates  level  of  transformer  oil  at  the  conservator  of  the  transformer.  It \nhas markings on transparent sheet for maximum & minimum levels. \n \n \n \n \n \nFigure1.3  Buchholz Relay \n \nPRESSURE RELEASE  \nDEVICE \n   FLOAT A \nOIL LEVEL \nBATTERY \nTRIPPING COIL \nDRAIN PLUG \nMERCURY AND  \nMERCURY SWITCH \nFROM MAIN TANK \nMERCURY IN GLASS \nTUBE \nMERCURY SWITCH \nBELL ALARM CIRCUIT \n \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n5 \n‚Ä¢ Inlet Valve \n \nIt  provide'),
('pranjal', 26, '                                                   \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n5 \n‚Ä¢ Inlet Valve \n \nIt  provides  passage  to  pour  the  transformer \noil  in  the  tank  during  purification  or  in  case  of \nshortage found in the tank. \n \n‚Ä¢ Outlet Valve \n \nIt  provides  passage  to  drain  the  oil  during \noverhauling or as and when required oil sample for \ntesting. \n \n‚Ä¢ Cooling Tubes \n \nThese  tubes  provide  better  and  effective  cooling  of  transformer  oil  by \nincreasing the surface area of tank to the atmosphere. \n \n‚Ä¢ Tape changer \n \nThe tape changer is used to regulate the out-\nput voltage manually according to line voltage. The \ntapes  of  transformer  can  be  changed  by  the  tape \nchanger manually.  It is provided on HV side so that \nthe  voltage  on  LV  side  feeding  to  the  load  can  be \nmaintained. Normally tap selection range is ¬± 15 % \nin steps of 2.5 %.  \n \n1.1.2    Cir'),
('pranjal', 27, 'anger manually.  It is provided on HV side so that \nthe  voltage  on  LV  side  feeding  to  the  load  can  be \nmaintained. Normally tap selection range is ¬± 15 % \nin steps of 2.5 %.  \n \n1.1.2    Circuit Breaker \n \nThe circuit breaker is an equipment which automatically cut off power supply of the \nsystem when any fault or short circuit occurs in the system. It detect and isolate faults within \na  fraction  of  a  second  thereby  minimizing  the  damage  at  the  point  where  the  fault  has \noccurred. The circuit breakers are specially designed to interrupt the very high fault currents, \nwhich may be ten or more times the normal operating currents. \n  \nThere are many types of circuit breakers, e.g. Oil, minimum oil, Air blast, Vacuum, \nSF6, etc. being used at sub-stations. This list is generally in order of their development and \nincreasing  fault  rupturing  capacity,  reliability  and  maintainability.  In  distribution  sub-\nstation, generally oil circuit breakers and air circui'),
('pranjal', 28, ' generally in order of their development and \nincreasing  fault  rupturing  capacity,  reliability  and  maintainability.  In  distribution  sub-\nstation, generally oil circuit breakers and air circuit breakers are used. \n \n1.1.3    Lightning Arrester \n \nLightning arrester is a most important protective device of distribution sub-station to \nprotect  valuable  equipment  as  well  as  working  personnel.  It  arrests  and  discharges  over \nvoltage  to  earth  during  lightning  strokes.  These  are  installed  between  line  and  earth  near \nequipment.  \nRepresentative values of a lightning stroke:   - Voltage - 2 x 10\n8\n volts. \n-  Current - 2 x 10\n4\n Amps \n-  Duration - 10\n-5\n seconds. \n-  Power - 8 x 10\n5\n kW \nRDSO  specification  No.  TI/SPC/PSI/LCMLA/00030  and  TI/MI/0041  Rev  0,  for \nLeakage  current  monitors  may  be  used  for  measuring the  Third  Harmonic  Resistive \nComponent (THRC) of leakage current of lightning arresters. These LCM meters are being \nprocured by TRD'),
('pranjal', 29, ' for \nLeakage  current  monitors  may  be  used  for  measuring the  Third  Harmonic  Resistive \nComponent (THRC) of leakage current of lightning arresters. These LCM meters are being \nprocured by TRD organisation. \n \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n6\n1.1.4    Air Break (AB) Switch/ Isolator \n \nAir  break  switches  are  used  to  isolate  equipment  for  maintenance  and  also  for \ntransfer  of  load  from  one  bus  to  another.  Lay-out  of  sub-station  depends  upon  type  of  Air \nbreak switches. These switches are of two types viz. vertical break type or horizontal break \ntype. Horizontal break type normally occupies more space than the vertical break type.  \n \n1.1.5    Insulator  \n \nThe '),
('pranjal', 30, 'es. These switches are of two types viz. vertical break type or horizontal break \ntype. Horizontal break type normally occupies more space than the vertical break type.  \n \n1.1.5    Insulator  \n \nThe  main  function  of  an  insulator  is  to  insulate  live  conductor  or  equipment  at \ndifferent  voltages  with  reference  to  the  ground  structures  as  well  as  provide  mechanical \nsupport. Provision of adequate insulation in a substation is of primary importance from the \npoint of view of reliability of supply and safety of personnel. \n \n1.1.6    Bus Bar Arrangement \n \nThe bus bar is a conductor used to connect two and more equipment located side-by-\nside when the currents are very high. These are usually rectangular, sometimes tubular, bare \ncopper bars supported on insulators. The outdoor bus-bars  are  either of the rigid type or of \nthe strain type.  In the  rigid type, pipes are used for making connections among the various \nequipment.  The  strain  type  bus-bars  are  an'),
('pranjal', 31, 'e outdoor bus-bars  are  either of the rigid type or of \nthe strain type.  In the  rigid type, pipes are used for making connections among the various \nequipment.  The  strain  type  bus-bars  are  an  overhead  system  of  wires  strung  between  two \nsupporting  structures  and  supported  strain  type  insulators.  Since  the  bus  bars  are  rigid,  the \nclearances remain constant.  \n1.1.7    Capacitor Bank \nIt is a series parallel  combination of capacitors required to improve power factor of \nthe system. They act as reactive power generators, and provide the needed reactive power to \naccomplish  active  power  of  circuit.  This  reduces  the  amount  of  reactive  power,  and  thus \ntotal power (kVA) or the demand. The bank should be provided as near as possible to load. \n \n1.1.8    Earthing \n \nProvision  of  an  effective,  durable  and  a  dependable  earthing  in  a  substation  and \nswitching stations is very important for the safety of operating personnel as well as electri'),
('pranjal', 32, ' Earthing \n \nProvision  of  an  effective,  durable  and  a  dependable  earthing  in  a  substation  and \nswitching stations is very important for the safety of operating personnel as well as electrical \ndevices.  The  voltage  levels  do  not  rise  above  tolerable  thresholds  and  that  the  earth \nconnection  is  rugged  to  dissipate  the  fault  to  the earth.  Earthing  has  a  very  low  resistance \nand  connects  the  electrical  equipment  to  the  general  mass  of  the  earth.  Earthing  of  various \nequipment in sub-station is described in chapter 4, para 4.7. \n \n1.1.9    Fencing Arrangement   \n \nFencing is provided at outdoor sub-station yard for restricting entry of unauthorized \nperson  and  livestock.  It  must  be earthed/  grounded separately.  Height of fencing normally \nshould  not  be  less  than  1.8  metres.  Fencing  should be  painted  once  in  a  year  by  suitable \npaint. \n \n1.1.10   Distribution Panel Board \nDistribution  panel  board  consists  of  MCCB'),
('pranjal', 33, 'ly \nshould  not  be  less  than  1.8  metres.  Fencing  should be  painted  once  in  a  year  by  suitable \npaint. \n \n1.1.10   Distribution Panel Board \nDistribution  panel  board  consists  of  MCCBs,  control  equipment,  meters  and  relays \nare housed in the control room. The panel frame  shall be connected to the earth  grid by an \nearthing conductor. A rubber mat of prescribed size and quality shall lay in front of panel. \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n7 \n \n1.2 GRAVEL/CRUSHED ROCK \nIn  outdoor  switch  ‚Äìyard  areas  are  usually  covered  with  about  10cm  of  gravel  of \ncrushed rock of 40 mm size which increases the safety of personnel against shocks, prevent \nthe spread of oil splashes and aids in weed control.  \nThe resistivity '),
('pranjal', 34, '  with  about  10cm  of  gravel  of \ncrushed rock of 40 mm size which increases the safety of personnel against shocks, prevent \nthe spread of oil splashes and aids in weed control.  \nThe resistivity of gravel (œÅ) is 2000 ohm-meter while that of soil is 100 ohm-meter. \nSince œÅ of gravel is high, only a high voltage can force the current through the body to cause \ninjuries. The gravel act like insulator & throws the electric field generated by GPR back to \nsoil \n \n1.2.1    Advantages of Crushed Rock Used as a Surface Layer  \n \n‚Ä¢ It provides high resistivity surface layer  \n‚Ä¢ It serves as impediment to the movement of reptiles and thereby help in minimizing  \nthe hazards which can be caused by them \n‚Ä¢ It  prevents  the  formation  of  pools  of  oil  from  oil insulated  and  oil  cooled  electrical \nequipment \n‚Ä¢ It discourages the growth of weeds \n‚Ä¢ It helps retention of moisture on the underlying soil and thus helps in maintaining the \nresistivity of the subsoil at lower value. \n‚Ä¢ It d'),
('pranjal', 35, 'ectrical \nequipment \n‚Ä¢ It discourages the growth of weeds \n‚Ä¢ It helps retention of moisture on the underlying soil and thus helps in maintaining the \nresistivity of the subsoil at lower value. \n‚Ä¢ It discourages running of persons in the switchyard and saves them from the risk of \nbeing subjected to possible high step potentials. \n \n \n\n                                                                                                                            CAMTECH/ E/11-12/Sub-station/1.0 \nSeptember, 2011                                                     Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n8\n \nChapter 2 \n \nMAINTENANCE \n \n \n \nThe schedule maintenance of equipment installed in sub-station is essential to ensure \ntrouble free service and avoiding un-necessary interruptions.  \n \nFollowing    safety    precautions    should    be    observed    during    maintenance    of \ntransformers: \n Ensure all arrangements are safe. \n I'),
('pranjal', 36, 'vice and avoiding un-necessary interruptions.  \n \nFollowing    safety    precautions    should    be    observed    during    maintenance    of \ntransformers: \n Ensure all arrangements are safe. \n Isolate the transformer from supply and earth the terminals properly. \n Check & record the oil level in the tank before unseal the tank and unscrew the nuts \nand bolts. \n Ensure the work place is fire proof; care should be taken to prevent fire. \n Put a caution board ‚ÄúNO SMOKING‚Äù. \n The staff should not have anything in his breast pocket and should not wear watch or \nring. \nItem  wise  activities  involved  in  various  schedules of  sub-station equipped  with \ntransformers up to 1000 kVA are as follows: \n \n2.1 DAILY SCHEDULE (If manned) \n \nItems  Schedule Inspection Action required  \nSwitch yard \n \nAll jumpers & \nother connections\n \nCheck visually for flash/ \nspark marks  \nTighten the respective bi-\nmetallic clamp/ connection   \n Transformer \nTemperature Check oil temperature during \np'),
('pranjal', 37, 'h yard \n \nAll jumpers & \nother connections\n \nCheck visually for flash/ \nspark marks  \nTighten the respective bi-\nmetallic clamp/ connection   \n Transformer \nTemperature Check oil temperature during \npeak load hours. Check \nambient temperature \nEither switch off some load or \nshare with other transformer  \n \nTank Check for oil leakage  Arrest the leakage \n Dehydrating \nbreather  \nCheck visually colour of  \nsilica gel   \nEnsure blue colour of silica gel   \nControl Panel Room \n Relays Check visually target position  Take corrective action \n MCCB/Fuse   \n Load (amp.) Check against rated figure Reduce load if  higher  \n Voltage Check against rated figure Take corrective action \n PF meter Monitor the PF  reading Take corrective action. It should \nbe nearly unity \n General Ensure general cleanliness of room and panels  \nCapacitor Bank \n All connections Check visually for flash/ \nspark marks  \nTighten the clamp/ connection   \n\nCAMTECH/ E/11-12/Sub-station/1.0                                   '),
('pranjal', 38, 'ess of room and panels  \nCapacitor Bank \n All connections Check visually for flash/ \nspark marks  \nTighten the clamp/ connection   \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                                                                                                 \n \nHandbook on Maintenance of Electrical General Services Sub-Station             \nSeptember, 2011                   \n9 \n2.2 MONTHLY SCHEDULE \nNote: In addition to daily maintenance, carry out following works:  \n \nItems  Schedule Inspection Action required  \nSwitch yard \n \nYard Growth of unwanted shrubs, \ngarbage etc. \nKeep the yard free from shrubs,     \ngarbage etc. \n \nEarth pits  Check neatness and tidiness  Maintain tidiness and do \nwatering \n \nEarth \nconnections \nCheck all connection ends at \nearth pits and metal parts \nEnsure solid connection \n Transformer \nOil level  Check oil level in conservator       If low, top up with dry oil.  \nConnections Open terminal box cover and \ncheck connection'),
('pranjal', 39, 'th pits and metal parts \nEnsure solid connection \n Transformer \nOil level  Check oil level in conservator       If low, top up with dry oil.  \nConnections Open terminal box cover and \ncheck connections visually for \nflash/spark marks  \nTake corrective action  \n \nDehydrating \nbreather  \nCheck air passages. \nCheck colour of silica gel   \nClear passages, if required. \nReactivate silica gel if found \npink   \n Cleaning Entire transformer body \nexternally  \nClean entire transformer \nexternally including bushings \n Buchholz \nRelay \nCheck gas in the chamber Take corrective action \nControl Panel Room \n Load (amp.) Check load balancing If found unbalance, distribute the \nload equally on all phases  \n MCCB/Fuse Check current ratings  Provide proper size of MCCB/ \nFuse according to load condition\n \n \n2.3 QUARTERLY SCHEDULE \nNote: In addition to monthly maintenance, carry out following works:  \n \nItems  Schedule Inspection Action required  \nSwitch yard \n \nSupport \nInsulators \nExamine for cracks, ru'),
