('pranjal', 41, '                                               Handbook on Maintenance of Electrical General Services Sub-station           \n                   \n10\nItems  Schedule Inspection Action required  \n Transformer \n Bushing  Examine for cracks, rust and \nflash/ spark marks \nCheck for oil seepage \nClean and replace if required \n \nArrest leakage \nControl Panel Room \n Load (amp.) Check load balancing If found unbalance, distribute \nthe load equally on all phases  \n MCCB/Fuse Check condition for overheating Replace,  if required \n LT Bus bars \nCheck visually for overheating, \nflash/ spark marks   \nTake corrective action \n \n \n \n2.4 HALF YEARLY SCHEDULE \nNote: In addition to quarterly maintenance, carry out following works: \n \nItems  Schedule Inspection Action required  \n Transformer \n Oil Check BDV \n \nIf BDV < 30 kV/cm, do filtration \nto restore quality of oil. \n Cable box, \ngasketed  joints \nand gauges  \nInspect for leakage and cracks \nTake corrective action \n \n \nControl Panel Room \n Load (amp.) C'),
('pranjal', 42, 'If BDV < 30 kV/cm, do filtration \nto restore quality of oil. \n Cable box, \ngasketed  joints \nand gauges  \nInspect for leakage and cracks \nTake corrective action \n \n \nControl Panel Room \n Load (amp.) Check load balancing If found unbalance, distribute \nthe load equally on all three \nphases  \n \nOil circuit \nbreakers \nCheck oil level in the tanks.  \nTest  the  oil,  if  shows  signs  of \nmoisture, carbonization or dirt.  \nCheck    all    valves    for    oil \nleakage. \nCheck   the   condition   of   all \ngaskets   provided   to   prevent \nentrance  of  water  and  leakage \nof oil. \nMaintain at the proper height.  \n \nFilter or replace if necessary. \n \nArrest leakage \n \nEnsure they are healthy. \nCheck entire unit Clean with lint free cloth \nCheck contacts Clean fixed and moving contacts \n \nACB \nOperation \n \nCheck tripping of relay  \nClean   and   lubricate   operating \nmechanism  \nRe-set if required \n \n\nCAMTECH/ E/11-12/Sub-station/1.0                                                        '),
